;&lt;!--[if !supportLists]--&gt;17.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;LIMITATION OF LIABILITY&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;&lt;b&gt;No Medical Advice or\r\nRecommendations&lt;/b&gt;.&amp;nbsp; You acknowledge and\r\nagree that BetterMynd is not engaged in the practice of medicine and that we\r\nare not offering any medical or health-related advice or recommendation to any\r\nperson. &amp;nbsp;BetterMynd, its licensors, suppliers and all third parties who\r\npromote the Platform or provide you with a link to the Platform expressly\r\ndisclaim any and all liability resulting from the delivery of healthcare or\r\nhealth-related advice or recommendations to you by means of the Platform, including,\r\nbut not limited to, liability for professional or medical malpractice.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;&lt;b&gt;Exclusion of Certain Types\r\nof Damages&lt;/b&gt;. In no circumstances shall BetterMynd, its licensors or\r\nsuppliers or any third party who promotes the Platform or provides you with a\r\nlink to the service, be liable for any punitive, exemplary, consequential,\r\nincidental, indirect or special damages (including, without limitation, any\r\npersonal injury, lost profits, business interruption, loss of programs or other\r\ndata on your computer or otherwise) arising from or in connection with your use\r\nof the Platform, whether under a theory of breach of contract, negligence,\r\nstrict liability, malpractice or otherwise, even if we or they have been\r\nadvised in advance of the possibility of such damages.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;18.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;OPERATION OF THE PLATFORM; RECORD RETENTION&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid&quot;&gt;We reserve complete and sole discretion with respect to the operation of\r\nthe Platform. &amp;nbsp;Subject to applicable law,\r\nwe reserve the right to maintain, delete or destroy all communications and\r\nmaterials posted or uploaded to the Platform without prior notice pursuant to our\r\ninternal record retention and/or destruction policies.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;19.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;NOTICES&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;You agree that we may send to you in electronic form any privacy\r\nor other notices, disclosures, reports, documents, communications or other\r\nrecords regarding the Platform or related services (collectively, &quot;&lt;b&gt;Notices&lt;/b&gt;&quot;). &amp;nbsp;We can send you\r\nelectronic Notices (1) to the e-mail address that you provided to us during\r\nregistration, or (2) by posting the Notice on the Platform or otherwise through\r\nour site. The delivery of any Notice from us is effective when sent by us,\r\nregardless of whether you read the Notice when you receive it or whether you\r\nactually receive the delivery. &amp;nbsp;You can withdraw your consent to receive\r\nNotices electronically by canceling or discontinuing your use of the Platform.&amp;nbsp;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;20.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;INTERNATIONAL USE&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;The Platform is designed for and intended only for users in the\r\nUnited States. We make no representation that the information and services\r\nprovided on the Platform are applicable to, appropriate for, or available to\r\nusers in locations outside the United States. Accessing the Platform from\r\nterritories where the content is illegal is prohibited. If you choose to access\r\nthe Platform from a location outside the U.S., you do so on your own initiative\r\nand you are responsible for compliance with local laws.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;21.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;COPYRIGHT ACT&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid&quot;&gt;The Digital Millennium Copyright Act of 1998 (the &quot;DMCA&quot;)\r\nprovides recourse for copyright owners who believe that material appearing on\r\nthe Internet infringes their rights under U.S. copyright law.&amp;nbsp; If you\r\nbelieve in good faith that materials appearing on the Platform or the Site\r\ninfringe your copyright, you (or your agent) may send us a notice requesting\r\nthat the material be removed, or access to it blocked.&amp;nbsp; In addition, if\r\nyou believe in good faith that a notice of copyright infringement has been\r\nwrongly filed against you, the DMCA permits you to send us a\r\ncounter-notice.&amp;nbsp; Notices and counter-notices must meet statutory\r\nrequirements imposed by the DMCA.&amp;nbsp; One place to find more information is\r\nthe U.S. Copyright Office Web site, currently located at&amp;nbsp;&lt;a href=&quot;http://www.loc.gov/copyright&quot;&gt;&lt;b&gt;http://www.loc.gov/copyright&lt;/b&gt;&lt;/a&gt;&lt;span class=&quot;MsoHyperlink&quot;&gt;&lt;b&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span class=&quot;MsoHyperlink&quot;&gt;&lt;span style=&quot;text-decoration-line: none;&quot;&gt;22.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span class=&quot;MsoHyperlink&quot;&gt;NO EMERGENCY USE&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-weight:bold&quot;&gt;IMPORTANT\r\nINFORMATION ABOUT YOUR USE OF THE PLATFORM AND SITE: DO NOT USE THE PLATFORM OR\r\nTHE SITE FOR EMERGENCY MEDICAL NEEDS&lt;span style=&quot;text-transform:uppercase&quot;&gt;.&amp;nbsp;\r\nIf you experience a medical emergency, call 911 immediately.&amp;nbsp;&amp;nbsp;THIS\r\nWEBSITE, AND THE SERVICE, ARE BASED IN AND INTENDED FOR USE IN THE UNITED\r\nSTATES OF AMERICA ONLY; JURISDICTIONS OUTSIDE THE uNITED sTATES MAY NOT EMPLOY\r\n911 FOR EMERGENCY DISPATCH.&amp;nbsp; bETTERMYND\r\nDOES NOT PURPORT TO PROVIDE ANY GUIDANCE FOR PROCEDURES TO BE USED IN CASE OF\r\nEMERGENCIES OUTSIDE THE uNITED sTATES.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;23.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;MISCELLANEOUS PROVISIONS&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;&lt;b&gt;Governing Law and\r\nJurisdiction.&amp;nbsp; &lt;/b&gt;This Agreement shall\r\nbe governed by the laws of the State of Delaware without regard to its rules on\r\nconflicts or choice of law. &amp;nbsp;You hereby consent to the exclusive\r\njurisdiction of the courts of the State of Delaware for the resolution of any\r\ndispute based upon or relating to this Agreement.&lt;b&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;&lt;b&gt;Entire Agreement. &lt;/b&gt;&amp;nbsp;This Agreement constitutes the sole Agreement\r\nbetween you and BetterMynd relating to your use and our provision of the\r\nService and the subject matter hereof, and no representations, statements or\r\ninducements, oral or written, not contained in this Agreement shall bind either\r\nyou or BetterMynd.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;&lt;b&gt;Severability. &lt;/b&gt;Any of\r\nthe terms of this Agreement which are determined to be invalid or unenforceable\r\nshall be ineffective to the extent of such invalidity or unenforceability,\r\nwithout rendering invalid or unenforceable any of the remaining terms of this\r\nAgreement or affecting the validity or enforceability of the Agreement as a\r\nwhole. &lt;b&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;&lt;b&gt;Waiver.&amp;nbsp; &lt;/b&gt;Failure to insist on performance of any\r\nof the terms of the Agreement will not operate as a waiver of any subsequent\r\ndefault. &amp;nbsp;No waiver by BetterMynd of any right under this Agreement will\r\nbe deemed to be either a waiver of any other right or provision or a waiver of\r\nthat same right or provision at any other time.&lt;b&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;&lt;b&gt;Assignment.&amp;nbsp; &lt;/b&gt;You may not assign, transfer or delegate\r\nyour rights or obligations hereunder, in whole or in part. &amp;nbsp;This Agreement\r\nshall be binding upon and inure to the benefit of each of the parties and the\r\nparties\' respective successors and permitted assigns. &amp;nbsp;Except as otherwise\r\nspecifically.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;Electronic Facsimiles.&amp;nbsp; &lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-weight:bold&quot;&gt;A\r\nprinted version of this Agreement and of any related notice given in electronic\r\nform shall be admissible in judicial or administrative proceedings based upon\r\nor relating to this Agreement to the same extent and subject to the same\r\nconditions as other business documents and records originally generated and maintained\r\nin printed form.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-top:.25in;text-align:center;\r\nmso-pagination:widow-orphan lines-together;page-break-after:avoid&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;BETTERMIND\r\nPRIVACY POLICY&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;24.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;OVERVIEW&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify;mso-pagination:widow-orphan lines-together;\r\npage-break-after:avoid&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-weight:bold&quot;&gt;BetterMynd operates\r\nthe Site and provides the Platform. We are committed to ensuring that your\r\npersonal information shared over our Site and/or Platform is protected and kept\r\nconfidential.&amp;nbsp;&amp;nbsp; By accepting BetterMynd&rsquo;s Terms of Service or\r\nproviding information to us via our Site or Platform, you consent to the use\r\nand disclosure of personally identifiable information as outlined in this\r\nPrivacy Policy. Please note that the use and disclosure of such information is\r\nalso subject to the practices of the Counselors using the Platform.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;25.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;SECURITY OF PERSONAL INFORMATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid&quot;&gt;We take your privacy and the security of your personal information\r\nseriously.&amp;nbsp; Your personal information\r\nwill be stored in a secure manner. &amp;nbsp;We have implemented a variety of\r\ncommercially standard encryption and security technologies and procedures to\r\nprotect your personal information which is stored in our computer systems from\r\nunauthorized access. &amp;nbsp;We also maintain standard physical and electronic\r\nprocedural safeguards that limit access to your personal information to our\r\nemployees (or people working on our behalf and under confidentiality\r\nagreements) who, through the course of standard business activities, need to\r\naccess your personal information.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;26.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;COLLECTION AND USE OF PERSONAL INFORMATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;Personal information or protected health information is\r\ninformation that includes, but is not limited to, identifying data such as\r\nname, college, college identification number, social security number, address,\r\ncontact information, as well as information about personal health issues\r\nsubmitted through the Services.&amp;nbsp; This is the information we aim to\r\nprotect.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We will only collect information that is voluntarily\r\nsubmitted.&amp;nbsp; We know that privacy is of the utmost importance.&amp;nbsp; We\r\nvigorously believe in keeping confidential any and all personally identifiable\r\ninformation that identifies an individual user whether or not it relates to an\r\nindividual\'s past, present, or future physical or mental health\r\ncondition.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;As a Business Associate of health care providers that are Covered\r\nEntities under the federal health care privacy and security rules (HIPAA and\r\nHITECH), we maintain protected health information (PHI) in compliance with\r\nthese rules and our contractual obligations with health care providers.\r\nCurrently our main focus is providing a platform to allow individuals to\r\nreceive telehealth Services from various behavioral health providers.&amp;nbsp; We\r\ncollect information solely for the purposes of providing the Platform and\r\nassociated services, marketing and promoting the Platform and such services to\r\nyou, as well as for market research data.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We assume you are giving consent to this information collection\r\nand use, but we also give you the opportunity to &quot;opt out&quot; of\r\nreceiving direct marketing or market research information by emailing us at &lt;a href=&quot;mailto:students@bettermynd.com&quot;&gt;students@bettermynd.com&lt;/a&gt;. &amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We maintain web logs to record data about all visitors who use the\r\nSite and interact with the Platform and we will store this information.&amp;nbsp;\r\nThese logs may contain IP address information, types of operating system you\r\nuse, the date and time you visited the site, and information about the type of\r\ndevice you use to connect to the Site, the Platform and related services.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;All Web logs are stored securely and are accessible to a very\r\nlimited number of employees and contractors, who have to adhere to strict\r\nguidelines regarding user data security and privacy.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;27.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;NON-PERSONAL IDENTIFICATION/COOKIES TECHNOLOGY&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We use cookie technology in the aggregate as opposed to using any\r\npersonally identifiable information, to understand how our users collectively\r\nuse our Site and Platform. This helps us continually improve our services. Most\r\nweb browsers are set to accept cookies, but if you prefer not to receive\r\ncookies you can set your browser to warn you or refuse cookies all together by\r\nturning them off in your browser.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We may also use non-personal information to analyze data into\r\nuseful information. This process of data mining is done in the aggregate, is\r\nnon-personal, and allows Company to find correlations and patterns in the data.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;28.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;SAFEGUARDS EMPLOYED&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We use account information in a password-protected environment as\r\na security measure to protect your data.&amp;nbsp; We use administrative, physical\r\nand technical safeguards to protect data.&amp;nbsp; We maintain a high level of\r\ndata protection via safeguards such as data backup, audit controls, access\r\ncontrols, and some data encryption.&amp;nbsp; The Site and the Platform use\r\nindustry standard SSL encryption to enhance security of electronic data\r\ntransmissions.&amp;nbsp; In addition, we urge you to take precautionary measures in\r\nmaintaining the integrity of your data.&amp;nbsp; Please be responsible in making\r\nsure no one can see or has access to your personal account and log-in/password\r\ninformation.&amp;nbsp; If you use a public computer, &lt;i&gt;e.g&lt;/i&gt;., at a library or a university, always remember to log out of\r\nthe Site or Platform.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;If you use our Site or Platform through a public computer network\r\nor through an internet caf&eacute;, library or other potentially non-secure internet\r\nconnection, such use is at your own risk. It is your responsibility to check\r\nbeforehand on such other site\'s privacy and security policy with respect to\r\nInternet use.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We are not responsible for your handling, sharing, re-sharing\r\nand/or distribution of users&rsquo; personal health information.&amp;nbsp; Moreover, if\r\nyou forward personal health information electronically to another person on or\r\noff the Site or Platform, we are not responsible for any harm or other\r\nconsequences from third-party use or re-sharing of your information.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;29.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;SELF REVIEW OF DATA AND ABILITY TO DELETE YOUR\r\nACCOUNT INFORMATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;You may request to delete any personal information and to\r\nde-authorize the collection of personal information in the future by sending us\r\nan email at&amp;nbsp;&lt;a href=&quot;mailto:students@bettermynd.com&quot;&gt;students@bettermynd.com&lt;/a&gt;.\r\n&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;30.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;THIRD PARTY SITES/TRUSTED RELATIONSHIPS&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;As noted above, BetterMynd is a Business Associate of health care\r\nproviders under HIPAA and we share information with health care providers who\r\nprovide services to individuals, and they share information with us, for\r\npurposes related to treatment, payment and health care operations, and\r\notherwise as agreed or authorized by users.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;Our Site and Platform may contain links to other websites maintained\r\nby unrelated third parties.&amp;nbsp; We do not share your personally identifiable\r\ninformation with those websites (unless you specifically authorize such\r\nsharing) and are not responsible for their privacy procedures.&amp;nbsp; We seek to\r\nwork with trusted partners and organizations that will adhere to similar\r\nprivacy and ethical standards.&amp;nbsp; However, we encourage you to learn their\r\nparticular privacy policies.&amp;nbsp;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We disclose personally identifiable information about you as\r\nrequired or permitted by law, including complying with legal process (for\r\nexample, we may disclose your information as necessary to comply with an\r\nauthorized civil, criminal or regulatory investigation).&amp;nbsp; We fully\r\ncooperate with law enforcement agencies in identifying those who use our\r\nservices for illegal activities and may, in our sole discretion, disclose\r\npersonal information or other information to satisfy any law, regulation,\r\nsubpoena, or government request.&amp;nbsp; We reserve the right to release personal\r\ninformation or other information about users who we believe are engaged in\r\nillegal activities or are otherwise in violation of our Terms of Service, even\r\nwithout a subpoena, warrant or court order, if we believe, in our sole\r\ndiscretion, that such disclosure is necessary or appropriate to operate our web\r\nsite or to protect our rights or property, or that of our affiliates, or our\r\nofficers, directors, employees, agents, third-party content providers, suppliers,\r\nsponsors, or licensors.&amp;nbsp; We also reserve the right to report to law\r\nenforcement agencies any activities we reasonably believe in our sole\r\ndiscretion to be unlawful.&amp;nbsp; If we are legally compelled to disclose\r\ninformation about you to a third party, we will attempt to notify you by\r\nsending an email to the email address in our records unless doing so would\r\nviolate the law or unless you have not provided your email address to\r\nus.&amp;nbsp;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot; style=&quot;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;31.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;CHANGES TO THIS PRIVACY POLICY&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We may amend our Privacy Policy in the future.&amp;nbsp; In the event\r\nchanges are made, we will be sure to post changes at the Site and at other\r\nplaces we deem appropriate.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;32.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;QUESTIONS OR SUGGESTIONS&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;If you have any questions or suggestions on ways we can improve\r\nour Privacy Policy with respect to personal information, please email us\r\nat&amp;nbsp;&lt;a href=&quot;mailto:students@bettermynd.com&quot;&gt;students@bettermynd.com&lt;/a&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-top:.25in;text-align:center;\r\nline-height:normal&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;SPECIAL\r\nTERMS AND CONDITIONS FOR STUDENTS&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-top:.25in;text-align:justify;text-indent:31.5pt;\r\nline-height:normal&quot;&gt;&lt;span style=&quot;font-size:12.0pt;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;The following Special Terms and Conditions are a\r\nlegally-binding part of the BetterMynd Terms of Service but apply only to\r\nStudents. Capitalized Terms that are not otherwise defined herein shall have\r\nthe meanings ascribed to them in the BetterMynd Terms of Service.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;33.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;ACKNOWLEDGEMENT BY STUDENT &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify;text-indent:31.5pt&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;By accepting these Special Terms and Conditions, you\r\nacknowledge that you understand and agree with the following:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ3&quot;&gt;&lt;!--[if !supportLists]--&gt;1.&lt;span style=&quot;font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;The laws that protect privacy and the\r\nconfidentiality of medical information also apply to telemedicine;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ3&quot;&gt;&lt;!--[if !supportLists]--&gt;2.&lt;span style=&quot;font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;Telemedicine may involve electronic\r\ncommunication of certain parts of my personal medical information to medical\r\npractitioners who may be located in other areas, including out of state. &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ3&quot;&gt;&lt;!--[if !supportLists]--&gt;3.&lt;span style=&quot;font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;My healthcare information may be shared with\r\nother individuals for treatment, payment and healthcare operations purposes.\r\nPsychotherapy notes are maintained by clinicians but are not shared with\r\nothers.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ3&quot;&gt;&lt;!--[if !supportLists]--&gt;4.&lt;span style=&quot;font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;Without the my consent, my healthcare\r\ninformation may need to be shared in the following circumstances: (i)&amp;nbsp;if a\r\nvalid court order is issued for Student&rsquo;s medical records; (ii)&amp;nbsp;to report\r\nsuspected abuse, neglect, or domestic violence; and (iii)&amp;nbsp;in order to prevent\r\nor reduce a serious threat to anyone\'s health or safety.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot; style=&quot;margin-left:31.7pt;text-indent:-31.7pt;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;34.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;INFORMED CONSENT&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1CxSpMiddle&quot; style=&quot;margin-left:0in;mso-add-space:auto;text-indent:\r\n31.7pt;mso-list:none&quot;&gt;&lt;span style=&quot;font-weight:normal;mso-bidi-font-weight:\r\nbold&quot;&gt;By clicking the &quot;ACCEPT&quot; button you acknowledge that you are\r\nconsenting to receiving Counseling Services via the Platform. The scope of care\r\nwill be at the sole discretion of the Counselor who is treating you, with no\r\nguarantee of diagnosis, treatment, or prescription. The Platform respects and\r\nupholds patient confidentiality with respect to protected health information as\r\noutlined by the Health Insurance Portability and Accountability Act\r\n(&quot;HIPAA&quot;), and, subject to HIPAA regulations, will obtain your\r\nexpress &amp;nbsp;written consent prior to sharing\r\nany patient-identifiable information to a third party for purposes, other than\r\nas set forth above.. In addition, by clicking the &quot;ACCEPT&quot; button you\r\nare authorizing BetterMynd to release your contact information solely in order\r\nfor BetterMynd to provide you with marketing materials promoting the Platform.\r\nThe communications systems used will incorporate network and software security\r\nprotocols to protect the confidentiality of patient information and will\r\ninclude reasonable measures to safeguard the data and to ensure its integrity\r\nagainst intentional or unintentional corruption.&lt;/span&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1CxSpMiddle&quot; style=&quot;margin-left:0in;mso-add-space:auto;text-indent:\r\n31.7pt;mso-list:none&quot;&gt;&lt;span style=&quot;font-weight:normal;mso-bidi-font-weight:\r\nbold&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1CxSpLast&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;35.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;NO REPRESENTATIONS CONCERNING COUNSELOR\r\nQUALIFICATIONS&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt&quot;&gt;BetterMynd does not make any\r\nrepresentations or warranties about the training or skill of any Counselors who\r\nprovide Counseling Services via the Service or any outcomes. You are ultimately\r\nresponsible for choosing your particular Counselor. &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;36.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;WEBSITE CONTENT&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt&quot;&gt;Other than information received\r\ndirectly by you from a Counselor whose professional services you have engaged,\r\nthe content on the Site or received as a result of your use of the Platform should\r\nnot be considered medical advice. You should always talk to an appropriately\r\nqualified health care professional for diagnosis and treatment, including\r\ninformation regarding which medications or treatment may be appropriate for you.\r\nNone of the content on the Site or the Platform represents or warrants that any\r\nparticular medication or treatment is safe, appropriate, or effective for you.\r\nWithout limitation, BetterMynd does not recommend or endorse any specific\r\ntests, Counselors, medications, products or procedures.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;37.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;Your Obligation to Safeguard Your Username and\r\nPassword&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt&quot;&gt;Access to the Platform is enabled only\r\nby usernames and passwords. You should maintain your username and password in\r\nstrict confidence. In no event should you share your username or password with\r\nany third party or allow another person to access the Service using your\r\nusername and password. Please notify us if you have any reason to believe that\r\nyour username or password has been lost or compromised or misused in any way.\r\nYou are fully and solely responsible for any and all use of the Platform using\r\nyour username and password. We reserve the right to revoke or deactivate your\r\nusername and password at any time.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;38.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;GEOGRAPHIC LOCATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt&quot;&gt;You hereby certify that you are physically\r\nlocated in the State you choose/have chosen as your current location. You\r\nacknowledge that your ability to access and use the Platform and the Counseling\r\nServices is conditioned upon the truthfulness of this certification and that\r\nthe Counselors you access are relying upon this certification in order to\r\ninteract with you. In the event that your certification is inaccurate, you\r\nagree to indemnify BetterMynd and the providers you interact with from any\r\nresulting damages, costs or claims.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;39.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;PAYMENT AUTHORIZATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt&quot;&gt;By accepting the Terms of Service and\r\nthese Special Terms and Conditions for Students, you are authorizing BetterMynd\r\nto charge your credit card for the full amount due from you with respect to\r\nyour consultations with Counselors. Please note that BetterMynd may not be\r\ngiven full or complete information from your health plan regarding the\r\napplicable co-pay due from you for your consultation. As such, you may be\r\nbilled multiple times with respect to a consultation &ndash; once prior to beginning\r\nthe visit and a second time once your health plan has advised us as to what\r\nadditional co-pays, if any, you owe.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt&quot;&gt;You understand that this authorization\r\nto bill your credit card will remain in effect until you cancel it in writing,\r\nand you agree to notify BetterMynd in writing of any changes in your account\r\ninformation. In the case of an ACH Transaction being rejected for\r\nNon-Sufficient Funds (NSF), you understand that BetterMynd may at its\r\ndiscretion attempt to process the charge again at any time within 30 days. You acknowledge\r\nthat the origination of ACH transactions to your account must comply with the\r\nprovisions of U.S. law. You certify that you are an authorized user of this\r\ncredit card/bank account and will not dispute these scheduled transactions with\r\nyour bank or credit card company; so long as the transactions correspond to the\r\nco-payment required by your health plan.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;40.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;Changes in Fees&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify;text-indent:31.5pt&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;You acknowledge that we can change any charges\r\nassociated with your use of the BetterMynd Platform at any time, so long we provide\r\nyou at least thirty (30) days&rsquo; advance written notice of any fee increase that\r\nwould affect you.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&copy; 2017 BetterMynd\r\nInc. &amp;nbsp;All Rights Reserved.&lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;!--EndFragment--&gt;', 1, '2016-04-19 11:59:13', 'terms_and_conditions_patient', 1);
INSERT INTO `bm_cms_pages` (`page_id`, `page_title`, `page_content`, `page_created_by`, `page_createdon`, `page_slang`, `page_status`) VALUES
(2, 'Privacy Policy', '&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;BetterMynd.com provides robust software for the growing, member-based organization. Software highlights include: a private, member-facing online community; website, membership management features; member invoicing/dues system; email marketing; event management; and so much more. BetterMynd.com also provides sources of non-dues revenue in our career center and buyer\'s guide products. Our software solution helps member-based organizations build important connections; engage members and prospects; and grow through continued membership renewals, recruitment and increased sources of revenue.&lt;br&gt;&lt;br&gt;BetterMynd.com has been a global provider of online community software, membership software and association management software. Our customers span all seven continents and include associations, nonprofit organizations, educational institutions, government agencies, corporations, social networking sites and more.&lt;br&gt;&lt;br&gt;The following legal information below relates to BetterMynd.com as the provider of the software powering this website. BetterMynd.com is not responsible for the legal policies of our customers. For information regarding this customer\'s legal policies please contact the customer directly.&lt;span style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;Aggregate and De-Identified Information. We may share aggregate or de-identified information about users with third parties for marketing, advertising, research or similar purposes.&lt;br&gt;To Protect Us and Others. We also may disclose the information we collect from you, to the extent permitted by law, where we believe it is necessary to investigate, prevent, or take action regarding illegal activities, suspected fraud, situations involving potential threats to the safety of any person, violations of our Terms of Use or this Policy, or as evidence in litigation in which BetterMynd is involved.&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;In Response to Legal Process. We also may disclose the information we collect from you in order to comply with the law, a judicial proceeding, court order, or other legal process, such as in response to a subpoena in compliance with applicable privacy laws.&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;Business Transfers. If we are acquired by or merged with another company, if substantially all of our assets are transferred to another company, or if we are a part of a bankruptcy proceeding, we may transfer the information we have collected from you to the other Company.&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;Service Providers. We may disclose the information we collect from you to third party vendors, service providers, contractors or agents who perform functions on our behalf.&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;Healthcare Providers. As a Patient, your information will be shared with Healthcare Providers as directed and consented to by you. Our Services make your Assessments and related information available to your Healthcare Provider.&amp;nbsp;&amp;nbsp; &lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;We will not make information available to Healthcare Providers other than those with whom you have requested that we share your Assessments.&amp;nbsp; This Policy does not address how Healthcare Providers will use and disclose information obtained using BetterMynd.&amp;nbsp;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt; If you would like this information, you should ask your Healthcare Provider directly for a copy of his/her Notice of Privacy Practices.&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;We may share the information that we collect about you, including personally identifiable information, as follows:&lt;br&gt;HOW WE SHARE YOUR INFORMATION&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;To better understand how users access and use our Services, both on an aggregated and individualized basis, in order to improve our Site and Services and respond to user desires and preferences, and for other research and analytical purposes.&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;To display advertising on our Site.&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;To send offers and other promotional communications to Healthcare Providers;&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;To tailor the content and information that we may send or display, to offer location customization, and personalized help and instructions, and to otherwise personalize your experiences while using the Site or our Services.&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;To send you reminders and other information related to your care on behalf of your Healthcare Provider.&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;To communicate with you regarding the availability of Services on behalf of your Healthcare Provider, otherwise we do not market to Patients.&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;To communicate with you about your use of our Services, to respond to your inquiries, to provide technical support and assistance and for other customer service purposes.&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;To provide our Services.&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;We use the information that we gather about you for the following purposes:&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;&lt;u&gt;&lt;font color=&quot;#0000FF&quot;&gt;HOW WE USE YOUR INFORMATION&lt;/font&gt;&lt;/u&gt;&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;&lt;h6&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;Information We Collect Automatically. We may automatically collect the following information about your use of our Site or Services through cookies, web beacons, and other technologies: your domain name; your browser type and operating system; web pages you view; links you click; your IP address; a time and date stamp and the length of time you visit our Site and or use our Services; the referring URL, or the webpage that led you to our Site; and your browser type. We may combine this information with other information that we have collected about you, including, where applicable, your user name, name, and other personal information. Please see the section &ldquo;Our Use of Cookies and Other Tracking Mechanisms&rdquo; below for more information about our use of cookies and other tracking mechanisms.&lt;br&gt;&lt;br&gt;Information We Collect From Healthcare Providers.&amp;nbsp; Certain features and Services are available to patients because their Healthcare Providers use our Services. Healthcare Providers may provide patient names and e-mail addresses to us so we may communicate with patients on their behalf about the availability of certain Services.&lt;br&gt;&lt;br&gt;Other.&amp;nbsp; We also collect other information that you submit on our Site, such as comments and blog postings (see &ldquo;User Generated Content&rdquo; section below).&amp;nbsp; You must submit your name to post a comment to our blog and you may submit other optional information as well.&lt;br&gt;&lt;br&gt;Patient Registration.&amp;nbsp; Patients must provide certain information, including: name, date of birth, gender, address, email, mobile and work phone, as well as a user id and password.&amp;nbsp; We may also collect certain optional information, including: middle name or initial, home phone and other contact info, pharmacy name and contact details, other demographic information, health insurance information, credit card number and billing details, picture and communications preferences.&amp;nbsp; In addition, the Patient can communicate other health-related information to the Healthcare Provider during a video consultation via the BetterMynd app.&lt;br&gt;&lt;br&gt;Healthcare Provider Registration. To register, Healthcare Providers must provide certain information about themselves and their practices including: the Healthcare Provider&rsquo;s name, date of birth, gender, address, email, mobile and work phone; the Healthcare Provider&rsquo;s practice name, address, phone number and fax number; and a user id and password.&amp;nbsp; We may also collect certain optional information, including: middle name or initial, bank account or other payment information and other contact details, picture and communication preferences.&lt;br&gt;&lt;br&gt;Users may browse the informational areas of the Site without registering with. However, registration is required to use the Services. Once a Healthcare Provider has registered with us and subscribed to our Services, the Healthcare Provider can then invite Patients to use the Services. After receiving an invite, the Patient would then need to register for an BetterMynd account to use the Services.&lt;/font&gt;&lt;br&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/h6&gt;', 1, '2016-12-02 17:56:50', 'privacy_policy', 1);
INSERT INTO `bm_cms_pages` (`page_id`, `page_title`, `page_content`, `page_created_by`, `page_createdon`, `page_slang`, `page_status`) VALUES
