lass=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;text-align:center&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;BETTERMYND\r\nPLATFORM&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;text-align:center&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;TERMS\r\nOF SERVICE&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;PLEASE READ THE AGREEMENT BELOW\r\nAND INDICATE YOUR ACCEPTANCE BY CLICKING THE &quot;ACCEPT&quot; BUTTON&lt;span style=&quot;text-transform:uppercase&quot;&gt;. By clicking the &quot;ACCEPT&quot; checkbox,\r\nyou are indicating that you agree to be bound by all of the provisions in these\r\nterms of service&lt;/span&gt;. IF YOU DO NOT AGREE TO THESE TERMS OF SERVICE, DO NOT\r\nUSE THE BETTERMYND PLATFORM OR ANY ASSOCIATED SERVICES. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;Scope&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;.&amp;nbsp; The\r\nBetterMynd Terms of Service consist of the Terms of Service and the Privacy\r\nPolicy. The Terms of Service constitutes an agreement between you and\r\nBetterMynd, Inc. that allows you to make use of the BetterMynd website located\r\nat &lt;/span&gt;&lt;a href=&quot;http://www.bettermynd.com&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;www.bettermynd.com&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt; (the &ldquo;&lt;b&gt;Site&lt;/b&gt;&rdquo;) and the relevant services\r\nassociated with the Site (collectively, the &ldquo;&lt;b&gt;Platform&lt;/b&gt;&rdquo;) so long as you\r\ncomply with the requirements of the Terms of Service.&amp;nbsp; The Platform is owned and operated by\r\nBetterMynd Inc., a Delaware corporation with offices located at 3461 Holmead\r\nPlace NW, Washington, DC 20010 (&quot;&lt;b&gt;BetterMynd&rdquo; or &ldquo;We&rdquo; or &ldquo;Us&rdquo;&lt;/b&gt;).&amp;nbsp; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;Applicability&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;.&amp;nbsp; The\r\nPlatform is intended to make mental health care more accessible for college\r\nstudents (&ldquo;&lt;b&gt;Students&lt;/b&gt;&rdquo;) by facilitating connections and scheduling with\r\nqualified mental health care providers (&ldquo;&lt;b&gt;Counselors&lt;/b&gt;&rdquo;).&amp;nbsp; Most of the provisions of these Terms of\r\nService are generally applicable to all users of the Site and/or the Platform,\r\nincluding without limitation Students and Counselors (collectively, &ldquo;&lt;b&gt;End\r\nUsers&lt;/b&gt;&rdquo;), but some of the provisions are intended to apply only to (i)\r\nStudents using the Platform to schedule for, and arrange to obtain, mental\r\nhealth care services; and (ii) Counselors using the Platform to arrange for the\r\nprovision of mental health care services (hereinafter, &ldquo;&lt;b&gt;Counseling&lt;/b&gt; &lt;b&gt;Services&lt;/b&gt;&rdquo;)\r\nto Students.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;Special Terms and Conditions&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;. Because Students and Counselors will use the\r\nPlatform differently, in addition to these Terms of Service, there are separate\r\nSpecial Terms and Conditions that apply to use of the Platform by Students (&ldquo;&lt;b&gt;Special\r\nTerms and Conditions for Students&lt;/b&gt;&rdquo;) and by Counselors (&ldquo;&lt;b&gt;Special Terms\r\nand Conditions for Counselors&lt;/b&gt;&rdquo;). In each case, the Special Terms and\r\nConditions are incorporated by reference into these Terms of Service, and made\r\na part hereof.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;text-align:center&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;GENERALLY\r\nAPPLICABLE TERMS AND CONDITIONS&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;1.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;ELIGIBILITY FOR USE&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nli