earing on the Platform or the Site\r\ninfringe your copyright, you (or your agent) may send us a notice requesting\r\nthat the material be removed, or access to it blocked.&amp;nbsp; In addition, if\r\nyou believe in good faith that a notice of copyright infringement has been\r\nwrongly filed against you, the DMCA permits you to send us a\r\ncounter-notice.&amp;nbsp; Notices and counter-notices must meet statutory\r\nrequirements imposed by the DMCA.&amp;nbsp; One place to find more information is\r\nthe U.S. Copyright Office Web site, currently located at&amp;nbsp;&lt;a href=&quot;http://www.loc.gov/copyright&quot;&gt;&lt;b&gt;http://www.loc.gov/copyright&lt;/b&gt;&lt;/a&gt;&lt;span class=&quot;MsoHyperlink&quot;&gt;&lt;b&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span class=&quot;MsoHyperlink&quot;&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;\r\ntext-decoration:none;text-underline:none&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;22.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span class=&quot;MsoHyperlink&quot;&gt;&lt;span style=&quot;mso-bidi-font-weight:normal&quot;&gt;NO EMERGENCY USE&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-weight:bold&quot;&gt;IMPORTANT\r\nINFORMATION ABOUT YOUR USE OF THE PLATFORM AND SITE: DO NOT USE THE PLATFORM OR\r\nTHE SITE FOR EMERGENCY MEDICAL NEEDS&lt;span style=&quot;text-transform:uppercase&quot;&gt;.&amp;nbsp;\r\nIf you experience a medical emergency, call 911 immediately.&amp;nbsp;&amp;nbsp;THIS\r\nWEBSITE, AND THE SERVICE, ARE BASED IN AND INTENDED FOR USE IN THE UNITED\r\nSTATES OF AMERICA ONLY; JURISDICTIONS OUTSIDE THE uNITED sTATES MAY NOT EMPLOY\r\n911 FOR EMERGENCY DISPATCH.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;bETTERMYND\r\nDOES NOT PURPORT TO PROVIDE ANY GUIDANCE FOR PROCEDURES TO BE USED IN CASE OF\r\nEMERGENCIES OUTSIDE THE uNITED sTATES.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;23.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;MISCELLANEOUS PROVISIONS&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;&lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;Governing Law and\r\nJurisdiction.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;&lt;/b&gt;This Agreement shall\r\nbe governed by the laws of the State of Delaware without regard to its rules on\r\nconflicts or choice of law. &amp;nbsp;You hereby consent to the exclusive\r\njurisdiction of the courts of the State of Delaware for the resolution of any\r\ndispute based upon or relating to this Agreement.&lt;b style=&quot;mso-bidi-font-weight:\r\nnormal&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;&lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;Entire Agreement. &lt;/b&gt;&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&lt;/span&gt;This Agreement constitutes the sole Agreement\r\nbetween you and BetterMynd relating to your use and our provision of the\r\nService and the subject matter hereof, and no representations, statements or\r\ninducements, oral or written, not contained in this Agreement shall bind either\r\nyou or BetterMynd.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;&lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;Severability. &lt;/b&gt;Any of\r\nthe terms of this Agreement which are determined to be invalid or unenforceable\r\nshall be ineffective to the extent of such invalidity or unenforceability,\r\nwithout rendering invalid or unenforceable any of the remaining terms of this\r\nAgreement or affecting the validity or enforceability of the Agreement as a\r\nwhole. &lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;&lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;Waiver.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;&lt;/b&gt;Failure to insist on performance of any\r\nof the terms of the Agreement will not operate as a waiver of any subsequent\r\ndefault. &amp;nbsp;No waiver by BetterMynd of any right under this Agreement will\r\nbe deemed to be either a waiver of any other right or provision or a waiver of\r\nthat same right or provision at any other time.&lt;b style=&quot;mso-bidi-font-weight:\r\nnormal&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;&lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;Assignment.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;&lt;/b&gt;You may not assign, transfer or delegate\r\nyour rights or obligations hereunder, in whole or in part. &amp;nbsp;This Agreement\r\nshall be binding upon and inure to the benefit of each of the parties and the\r\nparties\' respective successors and permitted assigns. &amp;nbsp;Except as otherwise\r\nspecifically.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;Electronic Facsimiles.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-weight:bold&quot;&gt;A\r\nprinted version of this Agreement and of any related notice given in electronic\r\nform shall be admissible in judicial or administrative proceedings based upon\r\nor relating to this Agreement to the same extent and subject to the same\r\nconditions as other business documents and records originally generated and maintained\r\nin printed form.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-top:.25in;text-align:center;\r\nmso-pagination:widow-orphan lines-together;page-break-after:avoid&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;BETTERMIND\r\nPRIVACY POLICY&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;24.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;OVERVIEW&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify;mso-pagination:widow-orphan lines-together;\r\npage-break-after:avoid&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-weight:bold&quot;&gt;BetterMynd operates\r\nthe Site and provides the Platform. We are committed to ensuring that your\r\npersonal information shared over our Site and/or Platform is protected and kept\r\nconfidential.&amp;nbsp;&amp;nbsp; By accepting BetterMynd&rsquo;s Terms of Service or\r\nproviding information to us via our Site or Platform, you consent to the use\r\nand disclosure of personally identifiable information as outlined in this\r\nPrivacy Policy. Please note that the use and disclosure of such information is\r\nalso subject to the practices of the Counselors using the Platform.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;25.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;SECURITY OF PERSONAL INFORMATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot; style=&quot;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid&quot;&gt;We take your privacy and the security of your personal information\r\nseriously.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;Your personal information\r\nwill be stored in a secure manner. &amp;nbsp;We have implemented a variety of\r\ncommercially standard encryption and security technologies and procedures to\r\nprotect your personal information which is stored in our computer systems from\r\nunauthorized access. &amp;nbsp;We also maintain standard physical and electronic\r\nprocedural safeguards that limit access to your personal information to our\r\nemployees (or people working on our behalf and under confidentiality\r\nagreements) who, through the course of standard business activities, need to\r\naccess your personal information.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;26.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;COLLECTION AND USE OF PERSONAL INFORMATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;Personal information or protected health information is\r\ninformation that includes, but is not limited to, identifying data such as\r\nname, college, college identification number, social security number, address,\r\ncontact information, as well as information about personal health issues\r\nsubmitted through the Services.&amp;nbsp; This is the information we aim to\r\nprotect.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;We will only collect information that is voluntarily\r\nsubmitted.&amp;nbsp; We know that privacy is of the utmost importance.&amp;nbsp; We\r\nvigorously believe in keeping confidential any and all personally identifiable\r\ninformation that identifies an individual user whether or not it relates to an\r\nindividual\'s past, present, or future physical or mental health\r\ncondition.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;As a Business Associate of health care providers that are Covered\r\nEntities under the federal health care privacy and security rules (HIPAA and\r\nHITECH), we maintain protected health information (PHI) in compliance with\r\nthese rules and our contractual obligations with health care providers.\r\nCurrently our main focus is providing a platform to allow individuals to\r\nreceive telehealth Services from various behavioral health providers.&amp;nbsp; We\r\ncollect information solely for the purposes of providing the Platform and\r\nassociated services, marketing and promoting the Platform and such services to\r\nyou, as well as for market research data.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;We assume you are giving consent to this information collection\r\nand use, but we also give you the opportunity to &quot;opt out&quot; of\r\nreceiving direct marketing or market research information by emailing us at &lt;a href=&quot;mailto:students@bettermynd.com&quot;&gt;students@bettermynd.com&lt;/a&gt;. &lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;We maintain web logs to record data about all visitors who use the\r\nSite and interact with the Platform and we will store this information.&amp;nbsp;\r\nThese logs may contain IP address information, types of operating system you\r\nuse, the date and time you visited the site, and information about the type of\r\ndevice you use to connect to the Site, the Platform and related services.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;All Web logs are stored securely and are accessible to a very\r\nlimited number of employees and contractors, who have to adhere to strict\r\nguidelines regarding user data security and privacy.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;27.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;NON-PERSONAL IDENTIFICATION/COOKIES TECHNOLOGY&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;We use cookie technology in the aggregate as opposed to using any\r\npersonally identifiable information, to understand how our users collectively\r\nuse our Site and Platform. This helps us continually improve our services. Most\r\nweb browsers are set to accept cookies, but if you prefer not to receive\r\ncookies you can set your browser to warn you or refuse cookies all together by\r\nturning them off in your browser.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;We may also use non-personal information to analyze data into\r\nuseful information. This process of data mining is done in the aggregate, is\r\nnon-personal, and allows Company to find correlations and patterns in the data.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;28.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;SAFEGUARDS EMPLOYED&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;We use account information in a password-protected environment as\r\na security measure to protect your data.&amp;nbsp; We use administrative, physical\r\nand technical safeguards to protect data.&amp;nbsp; We maintain a high level of\r\ndata protection via safeguards such as data backup, audit controls, access\r\ncontrols, and some data encryption.&amp;nbsp; The Site and the Platform use\r\nindustry standard SSL encryption to enhance security of electronic data\r\ntransmissions.&amp;nbsp; In addition, we urge you to take precautionary measures in\r\nmaintaining the integrity of your data.&amp;nbsp; Please be responsible in making\r\nsure no one can see or has access to your personal account and log-in/password\r\ninformation.&amp;nbsp; If you use a public computer, &lt;i style=&quot;mso-bidi-font-style:\r\nnormal&quot;&gt;e.g&lt;/i&gt;., at a library or a university, always remember to log out of\r\nthe Site or Platform.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;If you use our Site or Platform through a public computer network\r\nor through an internet caf&eacute;, library or other potentially non-secure internet\r\nconnection, such use is at your own risk. It is your responsibility to check\r\nbeforehand on such other site\'s privacy and security policy with respect to\r\nInternet use.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;We are not responsible for your handling, sharing, re-sharing\r\nand/or distribution of users&rsquo; personal health information.&amp;nbsp; Moreover, if\r\nyou forward personal health information electronically to another person on or\r\noff the Site or Platform, we are not responsible for any harm or other\r\nconsequences from third-party use or re-sharing of your information.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;29.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;SELF REVIEW OF DATA AND ABILITY TO DELETE YOUR\r\nACCOUNT INFORMATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;You may request to delete any personal information and to\r\nde-authorize the collection of personal information in the future by sending us\r\nan email at&amp;nbsp;&lt;a href=&quot;mailto:students@bettermynd.com&quot;&gt;students@bettermynd.com&lt;/a&gt;.\r\n&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;30.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;THIRD PARTY SITES/TRUSTED RELATIONSHIPS&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;As noted above, BetterMynd is a Business Associate of health care\r\nproviders under HIPAA and we share information with health care providers who\r\nprovide services to individuals, and they share information with us, for\r\npurposes related to treatment, payment and health care operations, and\r\notherwise as agreed or authorized by users.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;Our Site and Platform may contain links to other websites maintained\r\nby unrelated third parties.&amp;nbsp; We do not share your personally identifiable\r\ninformation with those websites (unless you specifically authorize such\r\nsharing) and are not responsible for their privacy procedures.&amp;nbsp; We seek to\r\nwork with trusted partners and organizations that will adhere to similar\r\nprivacy and ethical standards.&amp;nbsp; However, we encourage you to learn their\r\nparticular privacy policies.&amp;nbsp;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;We disclose personally identifiable information about you as\r\nrequired or permitted by law, including complying with legal process (for\r\nexample, we may disclose your information as necessary to comply with an\r\nauthorized civil, criminal or regulatory investigation).&amp;nbsp; We fully\r\ncooperate with law enforcement agencies in identifying those who use our\r\nservices for illegal activities and may, in our sole discretion, disclose\r\npersonal information or other information to satisfy any law, regulation,\r\nsubpoena, or government request.&amp;nbsp; We reserve the right to release personal\r\ninformation or other information about users who we believe are engaged in\r\nillegal activities or are otherwise in violation of our Terms of Service, even\r\nwithout a subpoena, warrant or court order, if we believe, in our sole\r\ndiscretion, that such disclosure is necessary or appropriate to operate our web\r\nsite or to protect our rights or property, or that of our affiliates, or our\r\nofficers, directors, employees, agents, third-party content providers, suppliers,\r\nsponsors, or licensors.&amp;nbsp; We also reserve the right to report to law\r\nenforcement agencies any activities we reasonably believe in our sole\r\ndiscretion to be unlawful.&amp;nbsp; If we are legally compelled to disclose\r\ninformation about you to a third party, we will attempt to notify you by\r\nsending an email to the email address in our records unless doing so would\r\nviolate the law or unless you have not provided your email address to\r\nus.&amp;nbsp;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;31.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;CHANGES TO THIS PRIVACY POLICY&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;We may amend our Privacy Policy in the future.&amp;nbsp; In the event\r\nchanges are made, we will be sure to post changes at the Site and at other\r\nplaces we deem appropriate.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;32.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;QUESTIONS OR SUGGESTIONS&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot;&gt;If you have any questions or suggestions on ways we can improve\r\nour Privacy Policy with respect to personal information, please email us\r\nat&amp;nbsp;&lt;a href=&quot;mailto:students@bettermynd.com&quot;&gt;students@bettermynd.com&lt;/a&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-top:.25in;text-align:center;\r\nline-height:normal&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;SPECIAL\r\nTERMS AND CONDITIONS FOR STUDENTS&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-top:.25in;text-align:justify;text-indent:31.5pt;\r\nline-height:normal&quot;&gt;&lt;span style=&quot;font-size:12.0pt;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;The following Special Terms and Conditions are a\r\nlegally-binding part of the BetterMynd Terms of Service but apply only to\r\nStudents. Capitalized Terms that are not otherwise defined herein shall have\r\nthe meanings ascribed to them in the BetterMynd Terms of Service.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;33.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;ACKNOWLEDGEMENT BY STUDENT &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify;text-indent:31.5pt&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;By accepting these Special Terms and Conditions, you\r\nacknowledge that you understand and agree with the following:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;RJJ3&quot; style=&quot;mso-list:l1 level1 lfo2&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;1.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;The laws that protect privacy and the\r\nconfidentiality of medical information also apply to telemedicine;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ3&quot; style=&quot;mso-list:l1 level1 lfo2&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;2.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;Telemedicine may involve electronic\r\ncommunication of certain parts of my personal medical information to medical\r\npractitioners who may be located in other areas, including out of state. &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ3&quot; style=&quot;mso-list:l1 level1 lfo2&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;3.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;My healthcare information may be shared with\r\nother individuals for treatment, payment and healthcare operations purposes.\r\nPsychotherapy notes are maintained by clinicians but are not shared with\r\nothers.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ3&quot; style=&quot;mso-list:l1 level1 lfo2&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;4.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;Without the my consent, my healthcare\r\ninformation may need to be shared in the following circumstances: (i)&amp;nbsp;if a\r\nvalid court order is issued for Student&rsquo;s medical records; (ii)&amp;nbsp;to report\r\nsuspected abuse, neglect, or domestic violence; and (iii)&amp;nbsp;in order to prevent\r\nor reduce a serious threat to anyone\'s health or safety.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;margin-left:31.7pt;text-indent:-31.7pt;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;34.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;INFORMED CONSENT&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1CxSpMiddle&quot; style=&quot;margin-left:0in;mso-add-space:auto;text-indent:\r\n31.7pt;mso-list:none&quot;&gt;&lt;span style=&quot;font-weight:normal;mso-bidi-font-weight:\r\nbold&quot;&gt;By clicking the &quot;AGREE&quot; button you acknowledge that you are\r\nconsenting to receiving Counseling Services via the Platform. The scope of care\r\nwill be at the sole discretion of the Counselor who is treating you, with no\r\nguarantee of diagnosis, treatment, or prescription. The Platform respects and\r\nupholds patient confidentiality with respect to protected health information as\r\noutlined by the Health Insurance Portability and Accountability Act\r\n(&quot;HIPAA&quot;), and, subject to HIPAA regulations, will obtain your\r\nexpress &lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&lt;/span&gt;written consent prior to sharing\r\nany patient-identifiable information to a third party for purposes, other than\r\nas set forth above.. In addition, by clicking the &quot;AGREE&quot; button you\r\nare authorizing BetterMynd to release your contact information solely in order\r\nfor BetterMynd to provide you with marketing materials promoting the Platform.\r\nThe communications systems used will incorporate network and software security\r\nprotocols to protect the confidentiality of patient information and will\r\ninclude reasonable measures to safeguard the data and to ensure its integrity\r\nagainst intentional or unintentional corruption.&lt;/span&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1CxSpMiddle&quot; style=&quot;margin-left:0in;mso-add-space:auto;text-indent:\r\n31.7pt;mso-list:none&quot;&gt;&lt;span style=&quot;font-weight:normal;mso-bidi-font-weight:\r\nbold&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1CxSpLast&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;35.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;NO REPRESENTATIONS CONCERNING COUNSELOR\r\nQUALIFICATIONS&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt&quot;&gt;BetterMynd does not make any\r\nrepresentations or warranties about the training or skill of any Counselors who\r\nprovide Counseling Services via the Service or any outcomes. You are ultimately\r\nresponsible for choosing your particular Counselor. &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;36.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;WEBSITE CONTENT&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt&quot;&gt;Other than information received\r\ndirectly by you from a Counselor whose professional services you have engaged,\r\nthe content on the Site or received as a result of your use of the Platform should\r\nnot be considered medical advice. You should always talk to an appropriately\r\nqualified health care professional for diagnosis and treatment, including\r\ninformation regarding which medications or treatment may be appropriate for you.\r\nNone of the content on the Site or the Platform represents or warrants that any\r\nparticular medication or treatment is safe, appropriate, or effective for you.\r\nWithout limitation, BetterMynd does not recommend or endorse any specific\r\ntests, Counselors, medications, products or procedures.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;37.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;Your Obligation to Safeguard Your Username and\r\nPassword&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt&quot;&gt;Access to the Platform is enabled only\r\nby usernames and passwords. You should maintain your username and password in\r\nstrict confidence. In no event should you share your username or password with\r\nany third party or allow another person to access the Service using your\r\nusername and password. Please notify us if you have any reason to believe that\r\nyour username or password has been lost or compromised or misused in any way.\r\nYou are fully and solely responsible for any and all use of the Platform using\r\nyour username and password. We reserve the right to revoke or deactivate your\r\nusername and password at any time.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;38.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;GEOGRAPHIC LOCATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt&quot;&gt;You hereby certify that you are physically\r\nlocated in the State you choose/have chosen as your current location. You\r\nacknowledge that your ability to access and use the Platform and the Counseling\r\nServices is conditioned upon the truthfulness of this certification and that\r\nthe Counselors you access are relying upon this certification in order to\r\ninteract with you. In the event that your certification is inaccurate, you\r\nagree to indemnify BetterMynd and the providers you interact with from any\r\nresulting damages, costs or claims.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;39.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;PAYMENT AUTHORIZATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt&quot;&gt;By accepting the Terms of Service and\r\nthese Special Terms and Conditions for Students, you are authorizing BetterMynd\r\nto charge your credit card for the full amount due from you with respect to\r\nyour consultations with Counselors. Please note that BetterMynd may not be\r\ngiven full or complete information from your health plan regarding the\r\napplicable co-pay due from you for your consultation. As such, you may be\r\nbilled multiple times with respect to a consultation &ndash; once prior to beginning\r\nthe visit and a second time once your health plan has advised us as to what\r\nadditional co-pays, if any, you owe.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt&quot;&gt;You understand that this authorization\r\nto bill your credit card will remain in effect until you cancel it in writing,\r\nand you agree to notify BetterMynd in writing of any changes in your account\r\ninformation. In the case of an ACH Transaction being rejected for\r\nNon-Sufficient Funds (NSF), you understand that BetterMynd may at its\r\ndiscretion attempt to process the charge again at any time within 30 days. You acknowledge\r\nthat the origination of ACH transactions to your account must comply with the\r\nprovisions of U.S. law. You certify that you are an authorized user of this\r\ncredit card/bank account and will not dispute these scheduled transactions with\r\nyour bank or credit card company; so long as the transactions correspond to the\r\nco-payment required by your health plan.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;RJJ1&quot; style=&quot;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;&lt;span style=&quot;mso-list:Ignore&quot;&gt;40.&lt;span style=&quot;font:7.0pt &amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;Changes in Fees&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify;text-indent:31.5pt&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;You acknowledge that we can change any charges\r\nassociated with your use of the BetterMynd Platform at any time, so long we provide\r\nyou at least thirty (30) days&rsquo; advance written notice of any fee increase that\r\nwould affect you.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;!--[if gte mso 9]&gt;&lt;xml&gt;\r\n &lt;o:DocumentProperties&gt;\r\n  &lt;o:Revision&gt;0&lt;/o:Revision&gt;\r\n  &lt;o:TotalTime&gt;0&lt;/o:TotalTime&gt;\r\n  &lt;o:Pages&gt;1&lt;/o:Pages&gt;\r\n  &lt;o:Wor