alth care services (hereinafter, &ldquo;&lt;b&gt;Counseling&lt;/b&gt; &lt;b&gt;Services&lt;/b&gt;&rdquo;)\r\nto Students.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;Special Terms and Conditions&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;. Because Students and Counselors will use the\r\nPlatform differently, in addition to these Terms of Service, there are separate\r\nSpecial Terms and Conditions that apply to use of the Platform by Students (&ldquo;&lt;b&gt;Special\r\nTerms and Conditions for Students&lt;/b&gt;&rdquo;) and by Counselors (&ldquo;&lt;b&gt;Special Terms\r\nand Conditions for Counselors&lt;/b&gt;&rdquo;). In each case, the Special Terms and\r\nConditions are incorporated by reference into these Terms of Service, and made\r\na part hereof.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;text-align:center&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;GENERALLY\r\nAPPLICABLE TERMS AND CONDITIONS&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;1.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;ELIGIBILITY FOR USE&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-weight:bold&quot;&gt;To\r\nuse the Platform, you must be at least 18 years of age.&amp;nbsp; We do not intentionally make its services\r\navailable for use by persons under 18.&amp;nbsp;\r\nAlthough the Site is readily accessible to the public, use of the\r\nPlatform by Students or Counselors requires registration (and in the case of\r\nCounselors only, certain additional information must be furnished concerning location,\r\nlicensing and professional qualifications).&amp;nbsp;\r\n&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;2.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;ACCOUNT REGISTRATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;To access the Platform, you must first register to establish an\r\nindividual user account (&quot;&lt;b&gt;Account&lt;/b&gt;&quot;),\r\nby providing certain information. You agree that you will not create more than\r\none Account, or create an account for anyone other than yourself without first\r\nreceiving permission from the other person. In exchange for your use of the Platform\r\nand, if applicable, in order for users to send notices and other information to\r\nyou, you agree to: (i) provide true, accurate, current and complete information\r\nabout yourself as prompted by our Account registration form; and (ii) each time\r\nyou log on, maintain and promptly update such Account information to keep it\r\ntrue, accurate, current and complete. If you provide any information that is\r\nuntrue, inaccurate, not current or incomplete, or we have reasonable grounds to\r\nsuspect that such Account information is untrue, inaccurate, not current or\r\nincomplete, we reserve the right to suspend or terminate your Account and\r\nrefuse any and all current or future use of the Service.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;3.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;ACCESS CONTROLS&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;Access to the Platform is enabled only by usernames and\r\npasswords. &amp;nbsp;You should maintain your username and password in strict\r\nconfidence. &amp;nbsp;In no event should you share your username or password with\r\nany third party or allow another person to access the Platform using your username\r\nand password. &amp;nbsp;Please notify us if you have any reason to believe that\r\nyour username or password has been lost or compromised or misused in any way.\r\n&amp;nbsp;You are fully and solely responsible for any and all use of the Platform\r\nusing your username and password. &amp;nbsp;We reserve the right to suspend your\r\nuse of the Platform, or revoke or deactivate your username and password at any\r\ntime.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;4.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;END USER CONTENT&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;