&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;20.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;INTERNATIONAL USE&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;The Platform is designed for and intended only for users in the\r\nUnited States. We make no representation that the information and services\r\nprovided on the Platform are applicable to, appropriate for, or available to\r\nusers in locations outside the United States. Accessing the Platform from\r\nterritories where the content is illegal is prohibited. If you choose to access\r\nthe Platform from a location outside the U.S., you do so on your own initiative\r\nand you are responsible for compliance with local laws.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;21.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;COPYRIGHT ACT&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid&quot;&gt;The Digital Millennium Copyright Act of 1998 (the &quot;DMCA&quot;)\r\nprovides recourse for copyright owners who believe that material appearing on\r\nthe Internet infringes their rights under U.S. copyright law.&amp;nbsp; If you\r\nbelieve in good faith that materials appearing on the Platform or the Site\r\ninfringe your copyright, you (or your agent) may send us a notice requesting\r\nthat the material be removed, or access to it blocked.&amp;nbsp; In addition, if\r\nyou believe in good faith that a notice of copyright infringement has been\r\nwrongly filed against you, the DMCA permits you to send us a\r\ncounter-notice.&amp;nbsp; Notices and counter-notices must meet statutory\r\nrequirements imposed by the DMCA.&amp;nbsp; One place to find more information is\r\nthe U.S. Copyright Office Web site, currently located at&amp;nbsp;&lt;a href=&quot;http://www.loc.gov/copyright&quot;&gt;&lt;b&gt;http://www.loc.gov/copyright&lt;/b&gt;&lt;/a&gt;&lt;span class=&quot;MsoHyperlink&quot;&gt;&lt;b&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span class=&quot;MsoHyperlink&quot;&gt;&lt;span style=&quot;text-decoration-line: none;&quot;&gt;22.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span class=&quot;MsoHyperlink&quot;&gt;NO EMERGENCY USE&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-weight:bold&quot;&gt;IMPORTANT\r\nINFORMATION ABOUT YOUR USE OF THE PLATFORM AND SITE: DO NOT USE THE PLATFORM OR\r\nTHE SITE FOR EMERGENCY MEDICAL NEEDS&lt;span style=&quot;text-transform:uppercase&quot;&gt;.&amp;nbsp;\r\nIf you experience a medical emergency, call 911 immediately.&amp;nbsp;&amp;nbsp;THIS\r\nWEBSITE, AND THE SERVICE, ARE BASED IN AND INTENDED FOR USE IN THE UNITED\r\nSTATES OF AMERICA ONLY; JURISDICTIONS OUTSIDE THE uNITED sTATES MAY NOT EMPLOY\r\n911 FOR EMERGENCY DISPATCH.&amp;nbsp; bETTERMYND\r\nDOES NOT PURPORT TO PROVIDE ANY GUIDANCE FOR PROCEDURES TO BE USED IN CASE OF\r\nEMERGENCIES OUTSIDE THE uNITED sTATES.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;23.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;MISCELLANEOUS PROVISIONS&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;&lt;b&gt;Governing Law and\r\nJurisdiction.&amp;nbsp; &lt;/b&gt;This Agreement shall\r\nbe governed by the laws of the State of Delaware without regard to its rules on\r\nconflicts or choice of law. &amp;nbsp;You hereby consent to the exclusive\r\njurisdiction of the courts of the State of Delaware for the resolution of any\r\ndispute based upon or relating to this Agreement.&lt;b&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;&lt;b&gt;Entire Agreement. &lt;/b&gt;&amp;nbsp;This Agreement constitutes the sole Agreement\r\nbetween you and BetterMynd relating to your use and our provision of the\r\nService and the subject matter hereof, and no representations, statements or\r\ninducements, oral or written, not contained in this Agreement shall bind either\r\nyou or BetterMynd.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;&lt;b&gt;Severability. &lt;/b&gt;Any of\r\nthe terms of this Agreement which are determined to be invalid or unenforceable\r\nshall be ineffective to the extent of such invalidity or unenforceability,\r\nwithout rendering invalid or unenforceable any of the remaining terms of this\r\nAgreement or affecting the validity or enforceability of the Agreement as a\r\nwhole. &lt;b&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;&lt;b&gt;Waiver.&amp;nbsp; &lt;/b&gt;Failure to insist on performance of any\r\nof the terms of the Agreement will not operate as a waiver of any subsequent\r\ndefault. &amp;nbsp;No waiver by BetterMynd of any right under this Agreement will\r\nbe deemed to be either a waiver of any other right or provision or a waiver of\r\nthat same right or provision at any other time.&lt;b&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;&lt;b&gt;Assignment.&amp;nbsp; &lt;/b&gt;You may not assign, transfer or delegate\r\nyour rights or obligations hereunder, in whole or in part. &amp;nbsp;This Agreement\r\nshall be binding upon and inure to the benefit of each of the parties and the\r\nparties\' respective successors and permitted assigns. &amp;nbsp;Except as otherwise\r\nspecifically.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;Electronic Facsimiles.&amp;nbsp; &lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-weight:bold&quot;&gt;A\r\nprinted version of this Agreement and of any related notice given in electronic\r\nform shall be admissible in judicial or administrative proceedings based upon\r\nor relating to this Agreement to the same extent and subject to the same\r\nconditions as other business documents and records originally generated and\r\nmaintained in printed form.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-top:.25in;text-align:center;\r\nmso-pagination:widow-orphan lines-together;page-break-after:avoid&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;BETTERMIND\r\nPRIVACY POLICY&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;24.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;OVERVIEW&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify;mso-pagination:widow-orphan lines-together;\r\npage-break-after:avoid&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-weight:bold&quot;&gt;BetterMynd operates\r\nthe Site and provides the Platform. We are committed to ensuring that your\r\npersonal information shared over our Site and/or Platform is protected and kept\r\nconfidential.&amp;nbsp;&amp;nbsp; By accepting BetterMynd&rsquo;s Terms of Service or\r\nproviding information to us via our Site or Platform, you consent to the use\r\nand disclosure of personally identifiable information as outlined in this\r\nPrivacy Policy. Please note that the use and disclosure of such information is\r\nalso subject to the practices of the Counselors using the Platform.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;25.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;SECURITY OF PERSONAL INFORMATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid&quot;&gt;We take your privacy and the security of your personal information\r\nseriously.&amp;nbsp; Your personal information\r\nwill be stored in a secure manner. &amp;nbsp;We have implemented a variety of\r\ncommercially standard encryption and security technologies and procedures to\r\nprotect your personal information which is stored in our computer systems from\r\nunauthorized access. &amp;nbsp;We also maintain standard physical and electronic\r\nprocedural safeguards that limit access to your personal information to our\r\nemployees (or people working on our behalf and under confidentiality\r\nagreements) who, through the course of standard business activities, need to\r\naccess your personal information.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;26.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;COLLECTION AND USE OF PERSONAL INFORMATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;Personal information or protected health information is\r\ninformation that includes, but is not limited to, identifying data such as\r\nname, college, college identification number, social security number, address,\r\ncontact information, as well as information about personal health issues\r\nsubmitted through the Services.&amp;nbsp; This is the information we aim to\r\nprotect.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We will only collect information that is voluntarily\r\nsubmitted.&amp;nbsp; We know that privacy is of the utmost importance.&amp;nbsp; We\r\nvigorously believe in keeping confidential any and all personally identifiable\r\ninformation that identifies an individual user whether or not it relates to an\r\nindividual\'s past, present, or future physical or mental health\r\ncondition.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;As a Business Associate of health care providers that are Covered\r\nEntities under the federal health care privacy and security rules (HIPAA and\r\nHITECH), we maintain protected health information (PHI) in compliance with\r\nthese rules and our contractual obligations with health care providers.\r\nCurrently our main focus is providing a platform to allow individuals to\r\nreceive telehealth Services from various behavioral health providers.&amp;nbsp; We\r\ncollect information solely for the purposes of providing the Platform and\r\nassociated services, marketing and promoting the Platform and such services to\r\nyou, as well as for market research data.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We assume you are giving consent to this information collection\r\nand use, but we also give you the opportunity to &quot;opt out&quot; of\r\nreceiving direct marketing or market research information by emailing us at &lt;a href=&quot;mailto:providers@BetterMynd.com&quot;&gt;providers@BetterMynd.com&lt;/a&gt;. &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We maintain web logs to record data about all visitors who use the\r\nSite and interact with the Platform and we will store this information.&amp;nbsp;\r\nThese logs may contain IP address information, types of operating system you\r\nuse, the date and time you visited the site, and information about the type of\r\ndevice you use to connect to the Site, the Platform and related services.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;All Web logs are stored securely and are accessible to a very\r\nlimited number of employees and contractors, who have to adhere to strict\r\nguidelines regarding user data security and privacy.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;27.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;NON-PERSONAL IDENTIFICATION/COOKIES TECHNOLOGY&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We use cookie technology in the aggregate as opposed to using any\r\npersonally identifiable information, to understand how our users collectively\r\nuse our Site and Platform. This helps us continually improve our services. Most\r\nweb browsers are set to accept cookies, but if you prefer not to receive\r\ncookies you can set your browser to warn you or refuse cookies all together by\r\nturning them off in your browser.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We may also use non-personal information to analyze data into\r\nuseful information. This process of data mining is done in the aggregate, is\r\nnon-personal, and allows Company to find correlations and patterns in the data.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;28.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;SAFEGUARDS EMPLOYED&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We use account information in a password-protected environment as\r\na security measure to protect your data.&amp;nbsp; We use administrative, physical\r\nand technical safeguards to protect data.&amp;nbsp; We maintain a high level of\r\ndata protection via safeguards such as data backup, audit controls, access\r\ncontrols, and some data encryption.&amp;nbsp; The Site and the Platform use\r\nindustry standard SSL encryption to enhance security of electronic data\r\ntransmissions.&amp;nbsp; In addition, we urge you to take precautionary measures in\r\nmaintaining the integrity of your data.&amp;nbsp; Please be responsible in making\r\nsure no one can see or has access to your personal account and log-in/password\r\ninformation.&amp;nbsp; If you use a public computer, &lt;i&gt;e.g&lt;/i&gt;., at a library or a university, always remember to log out of\r\nthe Site or Platform.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;If you use our Site or Platform through a public computer network\r\nor through an internet caf&eacute;, library or other potentially non-secure internet\r\nconnection, such use is at your own risk. It is your responsibility to check\r\nbeforehand on such other site\'s privacy and security policy with respect to\r\nInternet use.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We are not responsible for your handling, sharing, re-sharing\r\nand/or distribution of users&rsquo; personal health information.&amp;nbsp; Moreover, if\r\nyou forward personal health information electronically to another person on or\r\noff the Site or Platform, we are not responsible for any harm or other consequences\r\nfrom third-party use or re-sharing of your information.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;29.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;SELF REVIEW OF DATA AND ABILITY TO DELETE YOUR\r\nACCOUNT INFORMATION&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;You may request to delete any personal information and to\r\nde-authorize the collection of personal information in the future by sending us\r\nan email at&amp;nbsp;&lt;a href=&quot;mailto:providers@BetterMynd.com&quot;&gt;providers@BetterMynd.com&lt;/a&gt;.\r\n&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;30.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;THIRD PARTY SITES/TRUSTED RELATIONSHIPS&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;As noted above, BetterMynd is a Business Associate of health care\r\nproviders under HIPAA and we share information with health care providers who\r\nprovide services to individuals, and they share information with us, for\r\npurposes related to treatment, payment and health care operations, and\r\notherwise as agreed or authorized by users.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;Our Site and Platform may contain links to other websites\r\nmaintained by unrelated third parties.&amp;nbsp; We do not share your personally\r\nidentifiable information with those websites (unless you specifically authorize\r\nsuch sharing) and are not responsible for their privacy procedures.&amp;nbsp; We\r\nseek to work with trusted partners and organizations that will adhere to\r\nsimilar privacy and ethical standards.&amp;nbsp; However, we encourage you to learn\r\ntheir particular privacy policies.&amp;nbsp;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We disclose personally identifiable information about you as\r\nrequired or permitted by law, including complying with legal process (for\r\nexample, we may disclose your information as necessary to comply with an\r\nauthorized civil, criminal or regulatory investigation).&amp;nbsp; We fully\r\ncooperate with law enforcement agencies in identifying those who use our\r\nservices for illegal activities and may, in our sole discretion, disclose\r\npersonal information or other information to satisfy any law, regulation,\r\nsubpoena, or government request.&amp;nbsp; We reserve the right to release personal\r\ninformation or other information about users who we believe are engaged in\r\nillegal activities or are otherwise in violation of our Terms of Service, even\r\nwithout a subpoena, warrant or court order, if we believe, in our sole\r\ndiscretion, that such disclosure is necessary or appropriate to operate our web\r\nsite or to protect our rights or property, or that of our affiliates, or our\r\nofficers, directors, employees, agents, third-party content providers, suppliers,\r\nsponsors, or licensors.&amp;nbsp; We also reserve the right to report to law\r\nenforcement agencies any activities we reasonably believe in our sole\r\ndiscretion to be unlawful.&amp;nbsp; If we are legally compelled to disclose\r\ninformation about you to a third party, we will attempt to notify you by\r\nsending an email to the email address in our records unless doing so would\r\nviolate the law or unless you have not provided your email address to\r\nus.&amp;nbsp;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot; style=&quot;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;31.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;CHANGES TO THIS PRIVACY POLICY&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;We may amend our Privacy Policy in the future.&amp;nbsp; In the event\r\nchanges are made, we will be sure to post changes at the Site and at other\r\nplaces we deem appropriate.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot;&gt;&lt;!--[if !supportLists]--&gt;32.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;QUESTIONS OR SUGGESTIONS&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot;&gt;If you have any questions or suggestions on ways we can improve\r\nour Privacy Policy with respect to personal information, please email us\r\nat&amp;nbsp;&lt;a href=&quot;mailto:providers@BetterMynd.com&quot;&gt;providers@BetterMynd.com&lt;/a&gt;.\r\n&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-top:.25in;text-align:center;\r\nline-height:normal;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;SPECIAL TERMS\r\nAND CONDITIONS FOR COUNSELORS&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-top:.25in;text-align:justify;text-indent:31.5pt;\r\nline-height:normal&quot;&gt;&lt;span style=&quot;font-size:12.0pt;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;The following Special Terms and Conditions are an\r\ninextricable and legally-binding part of the BetterMynd Terms of Service but\r\nthey apply only to Counselors. Capitalized Terms that are not otherwise defined\r\nherein shall have the meanings ascribed to them in the BetterMynd Terms of\r\nService.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1CxSpFirst&quot;&gt;&lt;!--[if !supportLists]--&gt;33.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;PRIORITY OF AGREEMENTS&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1CxSpMiddle&quot; style=&quot;margin-left:0in;mso-add-space:auto;text-indent:\r\n31.5pt;mso-list:none&quot;&gt;&lt;span style=&quot;font-weight:normal;mso-bidi-font-weight:\r\nbold&quot;&gt;These Special Terms and Conditions for Counselors apply to all use of the\r\nPlatform by Counselors. It is contemplated that each Counselor that uses the\r\nPlatform will also enter into a separate contract with BetterMynd that will\r\nmore fully define the parties&rsquo; relationship (hereinafter, the &ldquo;&lt;/span&gt;Counselor\r\nAgreement&lt;span style=&quot;font-weight:normal;mso-bidi-font-weight:bold&quot;&gt;&rdquo;). If and\r\nto the extent there exists a conflict between any provision of these Special\r\nTerms and Conditions for Counselors and any Counselor Agreement, the terms and\r\nconditions of the Counselor Agreement shall govern.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1CxSpMiddle&quot; style=&quot;margin-left:0in;mso-add-space:auto;text-indent:\r\n31.5pt;mso-list:none&quot;&gt;&lt;span style=&quot;font-weight:normal;mso-bidi-font-weight:\r\nbold&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1CxSpLast&quot;&gt;&lt;!--[if !supportLists]--&gt;34.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;ACKNOWLEDGEMENT BY COUNSELOR &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify;text-indent:31.5pt&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;By accepting these Terms of Service, you acknowledge\r\nthat you understand and agree with the following:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ3&quot;&gt;&lt;!--[if !supportLists]--&gt;1.&lt;span style=&quot;font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;The laws that protect privacy and the\r\nconfidentiality of medical information also apply to telemedicine;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ3&quot;&gt;&lt;!--[if !supportLists]--&gt;2.&lt;span style=&quot;font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;Telemedicine may involve electronic communication\r\nof my personal medical information to medical practitioners who may be located\r\nin other areas, including out of state. &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ3&quot;&gt;&lt;!--[if !supportLists]--&gt;3.&lt;span style=&quot;font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;Student healthcare information may be shared\r\nwith other individuals for treatment, payment and healthcare operations\r\npurposes. Psychotherapy notes are maintained by clinicians but are not shared\r\nwith others.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ3&quot;&gt;&lt;!--[if !supportLists]--&gt;4.&lt;span style=&quot;font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;Student healthcare information may be shared in\r\nthe following circumstances: (i)&amp;nbsp;When a valid court order is issued for\r\nmedical records; (ii)&amp;nbsp;Reporting suspected abuse, neglect, or domestic\r\nviolence; and (iii)&amp;nbsp;Preventing or reducing a serious threat to anyone\'s\r\nhealth or safety.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot; style=&quot;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;35.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;INFORMED CONSENT&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:31.5pt;mso-pagination:widow-orphan lines-together;\r\npage-break-after:avoid&quot;&gt;By clicking the &quot;ACCEPT&quot; button you\r\nacknowledge that you are consenting to provide mental health care services to\r\nStudents via the Platform. The scope and substantive content of the care provided\r\nwill be at your sole discretion, with no guarantee of diagnosis, treatment, or\r\nprescription. You will determine whether or not the condition being diagnosed\r\nand/or treated is appropriate for a telehealth encounter coordinated via the Platform.\r\nBetterMynd respects and upholds patient confidentiality with respect to\r\nprotected health information as outlined by the Health Insurance Portability\r\nand Accountability Act (&quot;HIPAA&quot;), and, subject to HIPAA regulations, we\r\nwill obtain express patient consent prior to sharing any patient-identifiable\r\ninformation with a third party for purposes other than treatment, payment or\r\nhealth care operations. In addition, by clicking the &quot;ACCEPT&quot; button\r\nyou are authorizing us to release your contact information solely in order for\r\nBetterMynd to provide you with marketing materials promoting the Platform. &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:.25in&quot;&gt;The communications systems used will\r\nincorporate network and software security protocols to protect the\r\nconfidentiality of patient information and will include reasonable measures to\r\nsafeguard the data and to ensure its integrity against intentional or\r\nunintentional corruption.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot; style=&quot;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;36.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;!--[endif]--&gt;GEOGRAPHIC RESTRICTION&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ2&quot; style=&quot;text-indent:.25in;mso-pagination:widow-orphan lines-together;\r\npage-break-after:avoid&quot;&gt;You certify that you are physically located in the state\r\nyou specified upon registration (the &ldquo;&lt;b&gt;Registered\r\nState&lt;/b&gt;&rdquo;), and agree at all times to only interact using the Platform with Students\r\nlocated in the Registered State. You\r\nrepresent that you are a certified mental health counselor in the Registered\r\nState. You acknowledge that your ability to access and use the Platform is\r\nconditional upon the truthfulness of the representations you make at the time\r\nof making contact with a Student; and that the Students you communicate with\r\nare relying upon these representations in order to interact with you. You agree to indemnify BetterMynd from any damages,\r\ncosts or claims arising in any way from the breach of any of the foregoing\r\nrepresentations.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;RJJ1&quot; style=&quot;mso-pagination:widow-orphan lines-together;page-break-after:\r\navoid;mso-list:l0 level1 lfo1&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:\r\n&amp;quot;Times New Roman Bold&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\nmso-bidi-font-family:&amp;quot;Times New Roman Bold&amp;quot;;text-transform:uppercase&quot;&gt;37.&lt;span style=&quot;font-variant-numeric: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman Bold&amp;quot;;\r\ntext-transform:uppercase&quot;&gt;Changes in Fees&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify;text-indent:31.5pt&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-font-weight:bold&quot;&gt;You acknowledge that we can change any charges\r\nassociated with your use of the BetterMynd Platform at any time, so long we\r\nprovide you at least thirty (30) days&rsquo; advance written notice of any fee\r\nincrease that would affect you.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&amp;nbsp;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&copy; 2017 Bettermynd\r\nInc. &amp;nbsp;All Rights Reserved.&lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;!--EndFragment--&gt;', 1, '2016-12-13 00:00:00', 'terms_and_conditions_third_party', 1);
INSERT INTO `bm_cms_pages` (`page_id`, `page_title`, `page_content`, `page_created_by`, `page_createdon`, `page_slang`, `page_status`) VALUES
(6, 'Contact Us', '&lt;p&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;If you have any questions about &lt;/span&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;BetterMynd &lt;/span&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;or would like to learn more about our services, please send us an email or contact us at the below.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;\r\n\r\nEmail: &lt;b&gt;info@bettermynd.com&lt;/b&gt;&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;Phone: &lt;b&gt;(202)813-0915&lt;/b&gt;&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;Twitter: &lt;b&gt;@bettermynd&lt;/b&gt;&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;Facebook: &lt;b&gt;www.facebook.com/bettermynd&lt;/b&gt;&lt;/span&gt;\r\n&lt;/p&gt;', 1, '2017-01-17 12:23:26', 'contact_us', 1);
INSERT INTO `bm_cms_pages` (`page_id`, `page_title`, `page_content`, `page_created_by`, `page_createdon`, `page_slang`, `page_status`) VALUES
(7, 'About Us', '&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;BetterMynd is an impact startup that is inspired to improve\r\nthe mental health of America&rsquo;s 21 million college students. &lt;/font&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 15px;&quot;&gt;BetterMynd makes mental health care more accessible\r\nto college students by providing them with additional counseling resources as\r\nwell as enabling them with teletherapy so that they can engage in private and\r\nsecure counseling sessions from anywhere that they can bring their laptop or\r\nsmartphone.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 15px;&quot;&gt;In recent years, the number of college students seeking mental\r\nhealth counseling has skyrocketed. However, the vast majority of colleges have\r\nstruggled to keep up with this increasing demand, many of which have waiting\r\nlists for students to receive help.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/o:p&gt;&lt;img src=&quot;data:image/png;base64,&quot; data-filename=&quot;About us infographic.png&quot; style=&quot;width: 989px;&quot;&gt;&lt;/p&gt;&lt;br&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;font face=&quot;Arial Black&quot;&gt;Our Mission&lt;/font&gt;&lt;/span&gt; &lt;/span&gt;&lt;/b&gt;&lt;/h3&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 15px;&quot;&gt;BetterMynd brings additional counseling resources to\r\ncolleges and their students, all from its secure, HIPAA compliant platform. By\r\nenabling students with teletherapy, BetterMynd allows them to access a much\r\nlarger and more diverse set of counseling resources. Students can login to\r\ntheir college&rsquo;s unique BetterMynd portal and see the bios, specialties, and\r\navailabilities of all of the different counselors who have been vetted to be\r\na part of the BetterMynd network. When it&rsquo;s time for their teletherapy session,\r\nthe student is able to connect from anywhere they can bring their laptop or mobile\r\ndevice.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;b&gt;&lt;i&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Who are the providers on the BetterMynd\r\nplatform?&lt;/font&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 15px;&quot;&gt;All of the mental health providers on the BetterMynd\r\nplatform have gone through a thorough vetting process. These providers\r\nhave a wide range of backgrounds and specialties, allowing students a more\r\ndiverse set of counseling options. All providers are licensed to practice in\r\nthe states that they are made available.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 15px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;b&gt;&lt;i&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;How much does a counseling session on\r\nBetterMynd cost?&lt;/font&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 15px;&quot;&gt;All sessions are 45-minutes in length and can vary in cost depending on\r\nthe provider&rsquo;s certifications and experience. All of the providers&rsquo; rates are\r\ntransparent and upfront, so that a student knows how much a session is going to\r\ncost them before they schedule a teletherapy session.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;b&gt;&lt;i&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Will my insurance cover my teletherapy\r\nsession?&lt;/font&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 15px;&quot;&gt;Most states require that insurance carriers provide\r\nreimbursement for teletherapy sessions in the same way they reimburse for\r\nin-person therapy sessions. Therefore, if your insurance covers mental health\r\nservices and traditional therapy sessions, it likely also provides coverage for\r\nteletherapy sessions. To be certain, it is best for students to reach out to\r\ntheir insurance carrier and understand their coverage.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 15px;&quot;&gt;Different providers on the BetterMynd platform accept\r\ndifferent types of insurance, while some may not accept any form of insurance.\r\nAll providers indicate which insurance types they accept so that students are\r\naware of whether or not their insurance may be accepted by certain providers.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 15px;&quot;&gt;BetterMynd processes all session charges in-full when\r\nappointments are made. The provider and the patient are therefore responsible\r\nfor exchanging any insurance information so that reimbursements can be made\r\nwhere appropriate.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;b&gt;&lt;i&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Can I schedule a teletherapy session with\r\none of my college&rsquo;s on-campus counselors?&lt;/font&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 15px;&quot;&gt;BetterMynd provides all of its colleges with the ability\r\nto engage in teletherapy sessions on its platform. However, each college\r\nchooses whether or not its on-campus counselors want to engage in teletherapy\r\nsessions with their students.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;b&gt;&lt;i&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;How do I bring BetterMynd to my college?&lt;/font&gt;&lt;/span&gt;&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 15px;&quot;&gt;BetterMynd is rapidly expanding to try and make mental\r\nhealth care more accessible for as many college students as possible. If you\r\nare a student, parent, or faculty member of a college that would benefit from\r\nBetterMynd, please reach out to us at &lt;/span&gt;&lt;a href=&quot;mailto:info@bettermynd.com&quot; style=&quot;background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt;info@bettermynd.com&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 15px;&quot;&gt;.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;', 1, '2017-01-17 12:36:04', 'about_us', 1);
INSERT INTO `bm_cms_pages` (`page_id`, `page_title`, `page_content`, `page_created_by`, `page_createdon`, `page_slang`, `page_status`) VALUES
