style=&quot;margin-left: 0.5in; text-indent: -0.25in; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\nmso-bidi-font-family:Wingdings;color:#333333&quot;&gt;&uuml;&lt;span style=&quot;font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:10.5pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;Provides ease-of-mind to students, prospective\r\nstudents, and their parents&lt;/span&gt;&lt;span style=&quot;font-size:10.0pt;font-family:\r\n&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left: 0.5in; text-indent: -0.25in; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\nmso-bidi-font-family:Wingdings;color:#333333&quot;&gt;&uuml;&lt;span style=&quot;font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:10.5pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;Simpler and more transparent referral process&lt;/span&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-bottom: 0px !important;&quot;&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left: 0.5in; text-indent: -0.25in; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\nmso-bidi-font-family:Wingdings;color:#333333&quot;&gt;&uuml;&lt;span style=&quot;font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:10.5pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;Reduces or eliminates counseling center wait\r\nlists&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;h4 style=&quot;padding: 0px; margin: 0px !important;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;text-indent: -0.25in;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;text-indent: -0.25in; font-size: 14px;&quot;&gt;BetterMynd is committed to improving the mental health of\r\ncollege students by providing them with a &ldquo;counselor in their pocket&rdquo;. By\r\nenabling students with teletherapy and providing them with additional\r\ncounseling resources, BetterMynd gives students more access to the help they\r\nneed while reducing the strain put on colleges&rsquo; limited on-campus resources.&lt;/span&gt;&lt;/font&gt;&lt;/h4&gt;&lt;h4 style=&quot;padding: 0px; margin: 0px !important;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;text-indent: -0.25in;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;If you have any questions about BetterMynd&rsquo;s services or would\r\nlike to learn more, please send us an email at &lt;/span&gt;&lt;a href=&quot;mailto:info@bettermynd.com&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;info@bettermynd.com&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;.&lt;/span&gt;&lt;/font&gt;&lt;/h4&gt;&lt;p class=&quot;MsoNoSpacing&quot;&gt;&lt;span style=&quot;font-size: 15px;&quot;&gt; &lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: left; margin-left: 0.5in; text-indent: -0.25in;&quot;&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;', 1, '2017-01-17 12:42:10', 'services', 1);
