INSERT INTO `bm_mail_templates` (`mail_template_id`, `mail_template_name`, `mail_subject`, `mail_template_content`, `mail_template_created_by`, `mail_template_createdon`, `mail_template_slang`, `mail_template_status`) VALUES
(1, 'A new Registration - Admin', 'A new Registration', '&lt;h3&gt;Dear {{identity}} ,&lt;/h3&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;A new &lt;b&gt;{{ROLE}}&lt;/b&gt;&amp;nbsp; has been registered on BetterMynd. The  {{ROLE}} details are:-&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Name: {{NAME}}&lt;/p&gt;\r\n&lt;p&gt;Email: {{EMAIL}}&lt;/p&gt;\r\n', 1, '2016-04-19 11:59:13', 'admin_mail_new_registration', 1),
(2, 'Registration (Provider)', 'Welcome to BetterMynd!', '&lt;h2&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Dear {{identity}},&lt;/span&gt;&lt;br&gt;&lt;/h2&gt;  \r\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Thank you for &amp;nbsp;signing up to be a counselor on BetterMynd! &lt;/p&gt;\r\n&lt;p&gt;In order to activate your account please click the button below and verify your email address.&lt;/p&gt;  \r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;  \r\n&lt;p&gt;&lt;a href=&quot;{{siteurl}}activate/{{id}}/{{activationcode}}&quot; style=&quot;line-height: 1.6; font-weight: bold; text-decoration: none; border-radius: 5px; color: rgb(255, 255, 255); padding: 15px 20px; text-align: center; background: rgb(45, 165, 255);&quot;&gt;Activate Account&lt;/a&gt;&lt;/p&gt; &amp;nbsp;  \r\n\r\n&lt;p&gt;If the button above doesn\'t work, paste the below URL into your browser:&lt;/p&gt;\r\n&lt;p&gt;&lt;a activate=&quot;&quot; href=&quot;{{siteurl}}activate/{{id}}/{{activationcode}}&quot;&gt;{{siteurl}}activate/{{id}}/{{activationcode}}&lt;/a&gt;&lt;/p&gt;  \r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;  \r\n&lt;p&gt;If you did not make this request or have any questions or concerns, please reach out to us at providers@bettermynd.com.&lt;/p&gt;', 1, '2016-04-19 11:59:13', 'activation_mail_provider', 1),
(3, 'Registration (Patient)', 'Welcome to BetterMynd!', '&lt;h3&gt;Dear {{identity}},&lt;br&gt;&lt;/h3&gt;  \r\n&lt;p&gt;Welcome to the BetterMynd Community! &lt;/p&gt;\r\n&lt;p&gt;In order to activate your account please click the button below to verify your email address.&lt;/p&gt;  \r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;  \r\n&lt;p&gt;&lt;a href=&quot;{{siteurl}}activate/{{id}}/{{activationcode}}&quot; style=&quot;line-height: 1.6; font-weight: bold; text-decoration: none; border-radius: 5px; color: rgb(255, 255, 255); padding: 15px 20px; text-align: center; background: rgb(45, 165, 255);&quot;&gt;Activate Account&lt;/a&gt;&lt;/p&gt; &amp;nbsp;  \r\n&lt;p&gt;If the button above doesn\'t work, paste this into your browser:&lt;/p&gt;  \r\n&lt;p&gt;&lt;a activate=&quot;&quot; href=&quot;{{siteurl}}activate/{{id}}/{{activationcode}}&quot;&gt;{{siteurl}}activate/{{id}}/{{activationcode}}&lt;/a&gt;&lt;/p&gt;  &lt;p&gt;&amp;nbsp;&lt;/p&gt;  &lt;p&gt;If you did not make this request or have any questions or concerns, please reach out to us at students@bettermynd.com.&lt;/p&gt;', 1, '2016-12-01 00:00:00', 'activation_mail_patient', 1),
(4, 'Registration (Third Party Provider)', 'Welcome to BetterMynd!', '&lt;h2&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;Dear {{identity}},&lt;/span&gt;&lt;br&gt;&lt;/h2&gt;  \r\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Thank you for signing up to be a counselor on BetterMynd!&lt;/p&gt;\r\n&lt;p&gt;In order to activate your account, please click on the button below.&lt;/p&gt;  \r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;  \r\n&lt;p&gt;&lt;a href=&quot;{{siteurl}}activate/{{id}}/{{activationcode}}&quot; style=&quot;line-height: 1.6; font-weight: bold; text-decoration: none; border-radius: 5px; color: rgb(255, 255, 255); padding: 15px 20px; text-align: center; background: rgb(45, 165, 255);&quot;&gt;Activate Account&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;If the button above doesn\'t work, paste the below URL into your browser:&lt;/p&gt;\r\n&lt;p&gt;&lt;a activate=&quot;&quot; href=&quot;{{siteurl}}activate/{{id}}/{{activationcode}}&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;{{siteurl}}activate/{{id}}/{{activationcode}}&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;If you did not make this request, please get in touch with us at providers@bettermynd.com.&lt;/p&gt;', 1, '2016-12-02 13:30:09', 'activation_mail_third_party', 1),
(5, 'College Registration', 'Activation Mail', '&lt;h3&gt;Dear {{identity}}&lt;/h3&gt;  \r\n&lt;p&gt;Welcome to BetterMynd Community!&lt;/p&gt;  \r\n&lt;p&gt;To activate your BetterMynd&amp;nbsp;Account, please click the button below:&lt;/p&gt;  \r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;  &lt;p&gt;&lt;a href=&quot;{{siteurl}}activate/{{id}}/{{activationcode}}&quot; style=&quot;line-height: 1.6; font-weight: bold; text-decoration: none; border-radius: 5px; color: rgb(255, 255, 255); padding: 15px 20px; text-align: center; background: rgb(85, 172, 238);&quot;&gt;Verify Email Address&lt;/a&gt;&lt;/p&gt; &amp;nbsp;  \r\n&lt;p&gt;This Confirmation Link can be clicked only once. If the link is not working, copy and paste the link in your browser:&lt;/p&gt;  \r\n&lt;p&gt;&lt;a activate=&quot;&quot; href=&quot;{{siteurl}}activate/{{id}}/{{activationcode}}&quot;&gt;{{siteurl}}activate/{{id}}/{{activationcode}}&lt;/a&gt;&lt;/p&gt;  &lt;p&gt;&amp;nbsp;&lt;/p&gt;  &lt;p&gt;If you did not make this request, please get in touch with us at: support@bettermynd.com&lt;/p&gt; ', 1, '2016-12-02 13:30:06', 'activation_mail_college', 1),
(6, 'Forgot Password', 'Reset Your Password', '&lt;p&gt;&lt;h3&gt;Dear {{identity}},&lt;/h3&gt;  \r\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Please click the below link to reset your BetterMynd password:&lt;/p&gt;  \r\n&lt;p&gt;&amp;nbsp;&lt;a href=&quot;{{siteurl}}reset_password/{{forgotcode}}&quot; style=&quot;background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;&quot;&gt;{{siteurl}}reset_password/{{forgotcode}}&lt;/a&gt;&lt;/p&gt;&amp;nbsp; **&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif;&quot;&gt;If clicking the link does not work, please copy and paste the URL into your browser instead.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif;&quot;&gt;If you have any questions or concerns please send us a message at support@bettermynd.com.&lt;br&gt;&lt;/span&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;  &lt;/p&gt;', 1, '2016-12-02 13:30:04', 'forgot_password', 1),
(7, 'Activated Profile (Provider)', 'Your BetterMynd Account Has Been Activated', '&lt;h2&gt;&lt;span style=&quot;font-size: 17px;&quot;&gt;Dear {{identity}},&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;Congratulations and welcome to BetterMynd!&amp;nbsp; Your profile is now live.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you you have any questions or concerns, please get in touch with us at providers@bettermynd.com.&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Yours,&lt;/p&gt;&lt;p&gt;The BetterMynd Team&lt;/p&gt;\r\n', 1, '2016-12-02 00:00:00', 'inactivation_mail_provider', 1),
(8, 'Inactive Mail', 'Your Account is Inactive', '&lt;h3&gt;Dear {{identity}},&lt;/h3&gt;\r\n\r\n&lt;p&gt;This is to notify you that your account&amp;nbsp; has been temporarily disabled by administrator. &lt;br&gt;&lt;/p&gt;&lt;p&gt;If you have any questions or concerns, please get in touch with us at support@bettermynd.com&lt;/p&gt;\r\n', 1, '2016-12-02 00:00:00', 'inactivation_mail', 1),
(9, 'Reactive Mail', 'Your Account is Active', '&lt;h2&gt;&lt;span style=&quot;font-size: 17px;&quot;&gt;Dear {{identity}},&lt;/span&gt;&lt;br&gt;&lt;/h2&gt;\r\n&lt;p&gt;Congratulations and welcome to BetterMynd!&amp;nbsp; Your profile is now live.&lt;/p&gt;\r\n&lt;p&gt;If you you have any questions or concerns, please get in touch with us at providers@bettermynd.com.&lt;br&gt;&lt;/p&gt;\r\n&lt;p&gt;Yours,&lt;/p&gt;&lt;p&gt;The BetterMynd Team&lt;/p&gt;\r\n', 1, '2016-12-02 00:00:00', 'reactivation_mail', 1),
(10, 'Change Password', 'BetterMynd Password Reset', '&lt;h3&gt;Dear {{identity}},&lt;/h3&gt;\r\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Your password has successfully been changed. Please &lt;a href=&quot;{{siteurl}}login&quot; style=&quot;background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;click here&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;to login to your account.&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;If you did not make this request, please get in touch with us at support@bettermynd.com.&lt;/p&gt;\r\n\r\n', 1, '2016-12-02 00:00:00', 'change_password', 1),
(12, 'BetterMynd Appointment Confirmation (Provider)', 'BetterMynd Appointment Confirmation', '&lt;h3&gt;Dear {{identity}},&lt;/h3&gt;\r\n&lt;p&gt;This is to notify you that your appointment with &amp;nbsp;&lt;span style=&quot;font-weight: 700;&quot;&gt;{{patient_name}}&lt;/span&gt;&amp;nbsp;has been confirmed.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Appointment Date: &amp;nbsp;{{appointment_date}}&lt;/p&gt;\r\n&lt;p&gt;Time Slot: {{appointment_time}}&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;If you need to modify your appointment please login to your BetterMynd account.&lt;/p&gt;\r\n&lt;p&gt;Please reach out to us at support@bettermynd.com if you have any questions or concerns.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-size: 13px;&quot;&gt;&lt;a href=&quot;{{siteurl}}&quot; style=&quot;background: rgb(141, 37, 140); color: rgb(255, 255, 255); line-height: 1.6; font-weight: bold; border-radius: 5px; padding: 15px 20px; text-align: center;&quot;&gt;Login to BetterMynd&lt;/a&gt;&lt;/p&gt;\r\n&lt;span style=&quot;color: rgb(0, 0, 0); font-size: 13px;&quot;&gt;&amp;nbsp;&lt;/span&gt;\r\n&lt;p&gt;&lt;a href=&quot;{{siteurl}}&quot; style=&quot;background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;&quot;&gt;{{siteurl}}&lt;/a&gt;&lt;/p&gt;\r\n\r\n', 1, '2017-01-04 00:00:00', 'appointment_booked_provider', 1),
(13, 'BetterMynd Appointment Confirmation (Patient)', 'BetterMynd Appointment Confirmation', '&lt;h3&gt;Dear {{identity}},&lt;/h3&gt;\r\n&lt;p&gt;Your BetterMynd appointment has been confirmed by your provider. Please review the below details regarding your upcoming session:&lt;/p&gt;&lt;p style=&quot;padding:10px 0; font-size:14px; margin:0&quot;&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;p&gt;Provider\'s Name: &amp;nbsp;{{provider_name}}&lt;br&gt;&lt;/p&gt;\r\n&lt;p&gt;Appointment Date: &amp;nbsp;{{appointment_date}}&lt;/p&gt;\r\n&lt;p&gt;Time Slot: {{appointment_time}}&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;To modify your appointment, please login to your BetterMynd account or click on the button below. Please note that any appointments cancelled within 24 hours of their scheduled time slot are non-refundable.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;If you have any questions or concerns, please get in touch with us at support@bettermynd.com.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;a href=&quot;{{siteurl}}&quot; style=&quot;line-height: 1.6; font-weight: bold; text-decoration: none; border-radius: 5px; color: rgb(255, 255, 255); padding: 15px 20px; text-align: center; background: rgb(141, 37, 140);&quot;&gt;Login to BetterMynd&lt;br&gt;&lt;/a&gt;&lt;/p&gt;\r\n&amp;nbsp;\r\n&lt;p&gt;&lt;a activate=&quot;&quot; href=&quot;{{siteurl}}&quot; style=&quot;background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;&quot;&gt;{{siteurl}}&lt;/a&gt;&lt;br&gt;&lt;/p&gt;', 1, '2017-01-04 00:00:00', 'appointment_booked_patient', 1),
(16, 'BetterMynd Appointment Cancellation (Provider)', 'BetterMynd Appointment Cancellation', '&lt;h3&gt;Dear {{identity}},&lt;/h3&gt;\r\n\r\n&lt;p&gt;We apologize, but &lt;b&gt;{{patient_name}}&lt;/b&gt; has had to cancel their upcoming appointment.&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Appointment Date: &amp;nbsp;{{appointment_date}}&lt;/p&gt;\r\n&lt;p&gt;Time Slot: {{appointment_time}}&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;If this appointment was cancelled within 24 hours of the scheduled appointment time, you will still be paid in-full.&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;We have asked the patient to schedule another appointment with you based on your availability.&lt;/p&gt;\r\n&lt;p&gt;If you have any questions or concerns, please reach out to us at support@bettermynd.com.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;a href=&quot;{{siteurl}}login&quot; style=&quot;line-height: 1.6; font-weight: bold; text-decoration: none; border-radius: 5px; color: rgb(255, 255, 255); padding: 15px 20px; text-align: center; background: rgb(141, 37, 140);&quot;&gt;Login to BetterMynd&lt;br&gt;&lt;/a&gt;&lt;/p&gt;\r\n&amp;nbsp;&lt;p&gt;&lt;a activate=&quot;&quot; href=&quot;{{siteurl}}login&quot; style=&quot;background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;&quot;&gt;{{siteurl}}login&lt;/a&gt;&lt;/p&gt;', 1, '2017-01-04 00:00:00', 'appointment_canceled_provider', 1),
(17, 'BetterMynd Appointment Cancellation (Patient)', 'BetterMynd Appointment Cancellation', '&lt;p&gt;&lt;/p&gt;&lt;h3&gt;Dear {{identity}},&lt;/h3&gt;\r\n\r\n&lt;p&gt;We apologize, but your below session had to be cancelled by your requested provider. Your payment will be refunded in full.&lt;/p&gt;\r\n&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Appointment Date: &amp;nbsp;{{appointment_date}}&lt;/p&gt;\r\n&lt;p&gt;Time Slot: {{appointment_time}}&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Please login to your BetterMynd account to find the provider\'s next available session and schedule a new appointment.&lt;/p&gt;\r\n&lt;p&gt;If you have any questions or concerns, please reach out to us at students@bettermynd.com.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;a href=&quot;{{siteurl}}login&quot; style=&quot;line-height: 1.6; font-weight: bold; text-decoration: none; border-radius: 5px; color: rgb(255, 255, 255); padding: 15px 20px; text-align: center; background: rgb(141, 37, 140);&quot;&gt;Login to BetterMynd&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;a activate=&quot;&quot; href=&quot;{{siteurl}}login&quot; style=&quot;background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;&quot;&gt;{{siteurl}}login&lt;/a&gt;&lt;/p&gt;', 1, '2017-01-04 00:00:00', 'appointment_canceled_patient', 1),
(18, 'Welcome Mail (REMOVE)', 'Welcome to BetterMynd!', '&lt;h2&gt;Welcome to BetterMynd&lt;/h2&gt;\r\n&lt;h3&gt;Dear {{identity}}&lt;/h3&gt;  \r\n&lt;p&gt;Welcome to the BetterMynd Community! &lt;/p&gt;\r\n&lt;p&gt;Thanks for varifing your email address. Please &lt;a href=&quot;{{siteurl}}login&quot;&gt;click here&lt;/a&gt;&amp;nbsp;to login to your account.&lt;/p&gt;&amp;nbsp;&amp;nbsp;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif;&quot;&gt;&amp;nbsp;&lt;/span&gt;  &lt;p&gt;If you did not make this request or have questions or concerns, please reach out to us at support@bettermynd.com.&lt;/p&gt; ', 1, '2016-12-01 00:00:00', 'welcome_mail', 1),
(19, 'Appointment Cancellation Outside 24 Hours (Patient)', 'BetterMynd Appointment Cancellation', '&lt;h3&gt;Dear {{identity}},&lt;/h3&gt;\r\n&lt;p&gt;Your below session has been successfully cancelled. Your payment will be refunded in full.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Appointment Date: &amp;nbsp;{{appointment_date}}&lt;/p&gt;\r\n&lt;p&gt;Time Slot: {{appointment_time}}&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Please login to your BetterMynd account to schedule another appointment.&lt;/p&gt;\r\n&lt;p&gt;If you have any questions or concerns, please reach out to us at support@bettermynd.com.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;a href=&quot;{{siteurl}}login&quot; style=&quot;line-height: 1.6; font-weight: bold; text-decoration: none; border-radius: 5px; color: rgb(255, 255, 255); padding: 15px 20px; text-align: center; background: rgb(141, 37, 140);&quot;&gt;Login to BetterMynd&lt;/a&gt;&lt;/p&gt;\r\n&amp;nbsp;\r\n&lt;p&gt;&lt;a activate=&quot;&quot; href=&quot;{{siteurl}}login&quot; style=&quot;background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;&quot;&gt;{{siteurl}}login&lt;/a&gt;&lt;/p&gt;', 1, '2017-01-04 00:00:00', 'appointment_canceled_patitent_before24', 1),
(20, 'Appointment Cancellation Within 24 Hours (Patient)', 'BetterMynd Appointment Cancellation', '&lt;h3&gt;Dear {{identity}},&lt;/h3&gt;\r\n\r\n&lt;p&gt;Your below session has been cancelled successfully. Because this cancellation was made less than 24 hours before your scheduled appointment, you will not receive a refund.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Appointment Date: &amp;nbsp;{{appointment_date}}&lt;/p&gt;\r\n&lt;p&gt;Time Slot: {{appointment_time}}&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Please login to your BetterMynd account to find the provider\'s next available session and schedule a new appointment.&lt;/p&gt;\r\n&lt;p&gt;If you have any questions or concerns, please reach out to us at students@bettermynd.com.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;a href=&quot;{{siteurl}}login&quot; style=&quot;line-height: 1.6; font-weight: bold; text-decoration: none; border-radius: 5px; color: rgb(255, 255, 255); padding: 15px 20px; text-align: center; background: rgb(141, 37, 140);&quot;&gt;Login to BetterMynd&lt;br&gt;&lt;/a&gt;&lt;/p&gt;\r\n&amp;nbsp;\r\n&lt;p&gt;&lt;a activate=&quot;&quot; href=&quot;{{siteurl}}login&quot; style=&quot;background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;&quot;&gt;{{siteurl}}login&lt;/a&gt;&lt;br&gt;&lt;/p&gt;', 1, '2017-01-04 00:00:00', 'appointment_canceled_patitent_within24', 1),
(21, 'Appointment Cancellation Outside 24 Hours (Provider)', 'BetterMynd Appointment Cancellation', '&lt;h3&gt;Dear {{identity}},&lt;/h3&gt;&lt;p&gt;Your below appointment has been successfully cancelled.&lt;/p&gt;\r\n\r\n&lt;h5 style=&quot;margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&amp;nbsp;&lt;br&gt;&lt;/h5&gt;\r\n&lt;p&gt;Appointment Date: &amp;nbsp;{{appointment_date}}&lt;/p&gt;\r\n&lt;p&gt;Time Slot: {{appointment_time}}&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;We have asked the patient to schedule another appointment with you based on your availability.&lt;/p&gt;\r\n&lt;p&gt;If you have any questions or concerns, please reach out to us at providers@bettermynd.com.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;a href=&quot;{{siteurl}}login&quot; style=&quot;line-height: 1.6; font-weight: bold; text-decoration: none; border-radius: 5px; color: rgb(255, 255, 255); padding: 15px 20px; text-align: center; background: rgb(141, 37, 140);&quot;&gt;Login to BetterMynd&lt;br&gt;&lt;/a&gt;&lt;/p&gt;\r\n&amp;nbsp;\r\n&lt;p&gt;&lt;a activate=&quot;&quot; href=&quot;{{siteurl}}login&quot; style=&quot;background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;&quot;&gt;{{siteurl}}login&lt;/a&gt;&lt;br&gt;&lt;/p&gt;\r\n', 1, '2017-01-04 00:00:00', 'appointment_canceled_by_provider', 1),
(22, 'Contact Us', 'Contact Us', '&lt;h3&gt;Dear {{identity}}&lt;/h3&gt;\r\n\r\n\r\n&lt;p&gt;You have receive a new query from a user on {{site}}.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Name: &lt;/strong&gt;{{name}}&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Email: &lt;/strong&gt;{{email}}&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Subject: &lt;/strong&gt;{{subject}}&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Message: &lt;/strong&gt;{{message}}&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;If you did not make this request, please get in touch with us at: support@bettermynd.com&lt;/p&gt;\r\n\r\n', 1, '2016-12-02 00:00:00', 'contact_us', 1),
(23, 'Appointment Cancellation Notification - Admin', 'BetterMynd Appointment Cancellation', '&lt;h3&gt;Dear {{identity}},&lt;/h3&gt;\r\n\r\n&lt;p&gt;A session has been cancelled by {{cancelled_by}} . Below is the details:-&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Patient Name: &amp;nbsp;{{patient_name}}&lt;/p&gt;\r\n&lt;p&gt;Patient Email: &amp;nbsp;&amp;nbsp;{{patient_email}}&lt;/p&gt;\r\n&lt;p&gt;Counselor Name: &amp;nbsp;&amp;nbsp;{{counselor_name}}&lt;/p&gt;\r\n&lt;p&gt;Counselor Email: &amp;nbsp;&amp;nbsp;{{counselor_email}}&lt;br&gt;&lt;/p&gt;\r\n&lt;p&gt;Appointment Date: &amp;nbsp;{{appointment_date}}&lt;/p&gt;\r\n&lt;p&gt;Time Slot: {{appointment_time}}&lt;/p&gt;\r\n', 1, '2017-01-04 00:00:00', 'appointment_canceled_send_to_admin', 1),
(24, 'Appointment Cancellation By College- Provider and Patient', 'BetterMynd Appointment Cancellation', '&lt;h3&gt;Dear {{identity}},&lt;/h3&gt;\r\n\r\n&lt;p&gt;We apologize, but &lt;b&gt;{{college_name}}&lt;/b&gt; has had to cancel your upcoming appointment with &lt;b&gt;{{name}}&lt;/b&gt;. {{additional}}&lt;br&gt;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Appointment Date: &amp;nbsp;{{appointment_date}}&lt;/p&gt;\r\n&lt;p&gt;Time Slot: {{appointment_time}}&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;If you have any questions or concerns, please reach out to us at support@bettermynd.com.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;a href=&quot;{{siteurl}}login&quot; style=&quot;line-height: 1.6; font-weight: bold; text-decoration: none; border-radius: 5px; color: rgb(255, 255, 255); padding: 15px 20px; text-align: center; background: rgb(141, 37, 140);&quot;&gt;Login to BetterMynd&lt;/a&gt;&lt;/p&gt;\r\n&amp;nbsp;\r\n&lt;p&gt;&lt;a activate=&quot;&quot; href=&quot;{{siteurl}}login&quot; style=&quot;background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;&quot;&gt;{{siteurl}}login&lt;/a&gt;&lt;br&gt;&lt;/p&gt;', 1, '2017-01-04 00:00:00', 'appointment_canceled_by_college_provider', 1);
