INSERT INTO `bm_thirdparty_profile` (`thirdparty_profile_id`, `thirdparty_id`, `specialities`, `biography`, `insurance_carriers`, `session_cost`) VALUES
(1, 5, '2,6,7,17', 'Hello! My name is Wendy and I have been working with young adults for the past twenty years to help them overcome their life challenges and help them to be their happiest selves. I work closely with my clients to understand their issues and to come up with a solution that is a best fit for them.', '9,40,50', 10),
(2, 6, '2,6,9,13,15', 'Welcome to my profile. I have a masters in social work from Fordham University and a doctorate from Yeshiva University. In addition I have post- graduate training  in  Comprehensive Psychotherapy and Psychoanalysis from the National Institute for the Psychotherapies (NIP).  \r\n My  practice combines many theories with a single goal; I want you to feel better in your life. For some, this means processing thoughts, feelings and behaviors while others find comfort in finding the understanding of a professional to alleviate self doubt and shifting self esteem. \r\nPeople have come to me with all kinds of issues, and we have worked closely together to find solutions, whether that involves learning new ways to look at relationship difficulties, or methods for regulating problematic emotions, to career-related struggles and just getting rid of bad habits.  Regardless of my experience and training what really makes a good therapy experience  is the individual\'s willingness to want to look at themselves honestly. ,I hope you can take that all important first step: making an appointment.  I look forward to hearing from you and to understanding better how I can help you. ', '20,26,36,41', 95),
(3, 10, '2,6,12,13,16', 'Are you struggling with depression and anxiety? Using alcohol or drugs to cope? Do you find it hard to communicate your needs in your relationships? Feeling frustrated that you keep repeating the same unhealthy relationship patterns over and over again?\r\n\r\nI am a licensed clinical psychologist in NYC with over 16 years of experience providing psychotherapy and counseling for individuals and couples. My style is warm, engaging and collaborative. I utilize an integrative therapeutic approach, drawing from psychodynamic, cognitive-behavioral, and mindfulness perspectives. Treatment is provided in a safe and supportive environment. \r\n\r\nI am an out-of-network provider for most insurance plans. ', '54', 200),
(4, 14, '2,10,13', 'I am a licensed mental health counselor with over five years of experience working with a variety of clients.  I specialize in helping people manage their anxiety and I have a passion for working with the LGBT population.  I also work with all kinds of sex, sexuality, and gender issues.  I often feel that those issues tie in closely with anxiety.  ', '54', 70),
(5, 11, '2,6,9,17,16', 'In a warm and safe therapeutic environment, I invite you to begin a \"journey of change\". I am a Licensed Mental Health Counselor, Credentialed Alcoholism and Substance Abuse Counselor, and Certified Rehabilitation Counselor.\r\nI\'ll help you find your inner strength and personal power so you can make the changes needed to feel better and create a more fulfilling life. ', '28,29,50', 85),
(6, 18, '2,6,7,8,13', 'I look forward to collaborating with you on your journey of self-discovery, healing and recovery, and the immense possibilities of change. \r\nI specialize in the treatment of anxiety, depression, medically stable eating disorders, trauma and family or relationship issues.\r\nPlease contact me to arrange a personal consultation about how I may help you get started on this journey. ', '54', 120),
(7, 24, '2,8,9,12,17', 'As a child, I always had a strong desire to connect with people, hear their story and try to help. Being a therapist has been a journey, process and savior is many ways throughout my life. My philosophy as a clinician is to be there to create a safe, non-judgemental, caringenvironment that fosters individual growth. Life is a complicated series of twists and turns thatis much better navigated in a supportive environment that is encouraging and motivating. At Branches of Growth, I hope to create that for my clients.\r\n\r\nHaving discovered yoga many years ago, I utilize the practice of yoga as an integral piece of my ongoing, personal growth, healing and development. I am aRegistered Yoga Instructor with Yoga Alliance, receiving my certification from Grounded By Yoga in Bloomfield, NY.I believe in holistic healing, connecting the mind, body and soul for growth and continue to study about holistic practices to bring to my clients.\r\n\r\nThank you for taking the time to read about me and my journey. I hope to hear from you soon!', '8,29,40,44,45,46', 80),
(8, 26, '2,6,13,18,16', 'The semester is coming to an end! Let\'s get through this together.  Call me to set up your first appointment and let me know how I can help.\r\n\r\nDo you feel stuck?  Are you having trouble gaining balance and moving forward? Sometimes worry and sadness can interfere with our lives, counseling can help!  There may be a current situation that triggers memories from a past event.  Processing can help to clear the pathway for resolution and progress.  EMDR is a research based trauma resolution model that will provide a quicker treatment process.  \r\n\r\nAlthough I don\'t accept insurance directly.  You can pay the full cost of session with FSA and HSA accounts.  You can also access your out of network benefits and receive reimbursement based on your insurance plan.  We provide receipts for you to submit, Call to set up your first appointment!', '54', 100),
(9, 23, '2', 'Hi  iam Expert', '1', 100),
(10, 16, '2,6,12,16', 'Do you find that anxiety, worry and panic is taking over your life? You have struggled for a long time. You keep going, but feel exhausted. You have set goals, but feel stuck. You have contemplated seeking help, but put it off. We understand your hesitation to reach out. You are ready to change. You know you can be more productive, effective and satisfied with life. We can help you get back to being productive. We are experts in reducing anxiety, worry and panic. We have expertise in teaching you skills and tools to cope with depression and trauma memories. You can learn and create healthy drinking habits. We offer evening and weekend (Saturday and Sunday) appointments. \r\nWe can help you gain clarity, set new goals, achieve and maintain them. Our approach is strength-based and solution-focused. We bring a unique blend of helping you develop compassionate awareness while simultaneously teaching you specific, well researched skills, tools and coping strategies.', '1', 200),
(11, 36, '2,6,8,13,17', 'I am a NYS Licensed clinical psychologist with a certificate in school psychology.  I received a BA in Psychology from New York University, graduating cum laude, and a doctorate in Clinical Psychology from Long Island University  Post campus, completing my year-long APA-accredited internship at Woodhull Hospital in Brooklyn.\r\nWith formal training in several theoretical orientations (i.e., cognitive-behavioral therapy, psychodynamic psychotherapy, and family therapy), I am able to integrate different treatment approaches for the benefit of each client, including skills coaching, building distress tolerance, enhancing awareness and communication, facilitating personal insight, and illuminating maladaptive cognitions. Most importantly, I believe that we learn and grow through our relationships. Therefore, close attention is paid to the therapeutic relationship as it develops, as well as other significant relationships in a client\'s life. ', '20,26,41', 150),
(12, 35, '2,6,9,12,13', 'Losses can sometimes knock you off your path and make you question where you are suposed to go next. I can be your guide to help navigate the rocky roads that life sometimes presents. I have worked for over 15 years in the mental health field, helping individuals and couples from diverse backgrounds overcome and cope with a variety of issues.\r\nI started out at a day treatment facility in St. Petersburg, FL, working with adults with severe mental illness, such as schizophrenia while working on my master\'s degree. After I graduated ( and a hiatus traveling around the country with my two dogs), I began working at an outpatient clinic providing individual counseling and group therapy sessions. I moved back to WNY in 2010 and began writing health and nutrition articles for Livestrong. I continued working at a clinic providing individual counseling for adults and couples while starting my own practice.\r\nI live in Buffalo, NY with my husband and two spoiled dogs. I also volunteer at a dog rescue in my spare time.\r\n', '8,40,50', 80),
(13, 15, '2,6,13,17,16', 'Many college students struggle with anxiety and depression.  Having someone to talk to can be very helpful.  Therapy offers you the opportunity to learn about different aspects of yourself and learn healthier methods to cope on your own with these problems.\r\nUnderstanding yourself allows you to become more confident and to figure out the causes of your problems and how to overcome them on your own.  \r\nTalking about yourself lets become more grounded and realize how much you have to offer.  It will boost your self-esteem and lower your self-doubt.\r\nIve been a therapist for over 30 years and had the opportunity to work with many college students. As the executive director of a Psychotherapy training program in NYC, I collaborated with the NYU Counseling Center to devise strategies to help college students in short term and long-term therapy. \r\nMy approach is simple: as you talk and I listen, we come up with a plan of action together.  Having someone in your corner who listens without judgment can be very helpful.  It allows you to learn how to trust yourself and make good choices in life.\r\n', '54', 90),
(14, 7, '2,3,6,12,17', 'Education:\r\nRush University, Chicago, Doctor of Nursing Practice, 2015.\r\nRush University, Chicago, Degree of Psychiatric Mental Health Family Nurse Practitioner (PMHFNP), 2012\r\nSUNY IT, Master\'s Degree, Family Nurse Practitioner (FNP), 2008\r\nSt. Elizabeth College of Nursing, Registered Professional Nurse, 2001\r\n \r\nCertifications:\r\nBoard Certified Pyschitatric Mental Health Family Nurse Practitioner, ANCC\r\nBoard Certified Family Nurse Practitioner, AANP\r\n \r\nMembership:\r\nAmerican Psychological Association\r\nAmerican Psychiatric Nurses Association\r\nNurse Practitioner Association of New York State, past Mohawk Valley (MV) Chapter President, past MV Vice-President\r\nAmerican Association of Nurse Practitioners\r\n\r\nPresent Tense Psychiatry Philosophy: \r\nThere are so many psychiatric conditions that occur because we are focused on events of the past or concerned about events in the future. Present Tense Psychiatry is here to help you live and enjoy today.\r\n \r\nDr. Brady believes in a holistic approach (addressing personal, social, family, educational, and occupational stressors).\r\n \r\nEach patient is unique and will be treated as a partner in treatment, which may range from medication to meditation.\r\n \r\nShe uses evidence-based therapies including modern medication and therapies such as cognitive behavioral therapy and motivational interviewing techniques; natural remedies, and eastern philosophies (i.e. mindfulness and meditation) may also be utilized.', '54', 130),
(15, 41, '2', 'aassdada dsfb', '1', 1000),
(16, 68, '2,6,8,10,12', 'I firmly believe that we as human beings grow in relationships as an empathic and attuned other bears witness to our struggles; my role is to provide a safe environment and a skilled ear in which you are able to become better acquainted with yourself: your thinking, behavior, and feelings so that you can ultimately live a more fulfilled life. For some this means a few months of work and for others a few years.\r\n\r\nMy approach is integrative, collaborative, and informed by my training in depth psychology. Many have described me as gentle, empathic, and non-judgmental. I work with you to illuminate and build on your strengths and empower you to conquer negative patterns so you have greater emotional and overall psychological freedom.\r\n\r\nWhether it be depression, anxiety, trauma, relationship problems or any other struggles, you don\'t have to do it alone. Give me a call and lets take the next step together.', '54', 130),
(17, 31, '2', 'fggdgdfgfdgdfg', '2', 11),
(18, 75, '6,12,17', '**Medication and Therapy**\r\n\r\nPresent Tense Psychiatry Philosophy: \r\nThere are so many psychiatric conditions that occur because we are focused on events of the past or concerned about events in the future. Present Tense Psychiatry is here to help you live and enjoy today.\r\n \r\nDr. Brady believes in a holistic approach (addressing personal, social, family, educational, and occupational stressors).\r\n \r\nEach patient is unique and will be treated as a partner in treatment, which may range from medication to meditation.\r\n \r\nShe uses evidence-based therapies including modern medication and therapies such as cognitive behavioral therapy and motivational interviewing techniques; natural remedies, and eastern philosophies (i.e. mindfulness and meditation) may also be utilized.\r\n\r\nEducation:\r\nRush University, Chicago, Doctor of Nursing Practice, 2015.\r\nRush University, Chicago, Degree of Psychiatric Mental Health Family Nurse Practitioner (PMHFNP), 2012\r\nSUNY IT, Master\'s Degree, Family Nurse Practitioner (FNP), 2008\r\nSt. Elizabeth College of Nursing, Registered Professional Nurse, 2001\r\n \r\nCertifications:\r\nBoard Certified Pyschitatric Mental Health Family Nurse Practitioner, ANCC\r\nBoard Certified Family Nurse Practitioner, AANP\r\n \r\nMembership:\r\nAmerican Psychological Association\r\nAmerican Psychiatric Nurses Association\r\nNurse Practitioner Association of New York State, past Mohawk Valley (MV) Chapter President, past MV Vice-President\r\nAmerican Association of Nurse Practitioners', '54', 145),
(19, 117, '2,6,8,13', 'Testing Profile', '9', 20),
(20, 126, '6,8,10,13,17', 'When you\'re feeling unfulfilled, struggling with painful emotions or simply lost - I can help you face those challenges. We\'ll build on your existing strengths and develop the tools to make things better. In my many years living, working, and lecturing abroad (and here), I believe strongly that we all struggle with similar problems and emotions. The task of living requires that we figure out how to be happy and fulfilled, find meaning and direction, and live and love authentically. You are not alone in this journey; let\'s work together to understand your feelings and use them to guide your path.', '54', 120);
