INSERT INTO `bm_welcome_notes` (`type`, `note_title`, `notes_id`, `notes_detail`, `notes_add_date`, `notes_status`, `college_id`, `logo_cover`, `logo_image`) VALUES
(1, NULL, 1, '<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-weight: 700;\">Colgate\'s Counseling Center</span><br></p><p><font face=\"Arial, Helvetica, sans-serif\">Phone: 315-228-7385</font></p><p><font face=\"Arial, Helvetica, sans-serif\">Website: <a href=\"https://www.colgate.edu/offices-and-services/counseling\" target=\"_blank\">Colgate Counseling Center</a></font></p><p><span style=\"font-family: Arial, Helvetica, sans-serif; font-weight: 700;\">Crisis Resources</span></p><p>Colgate Campus Safety:&nbsp;<span style=\"font-family: Arial, Helvetica, sans-serif;\">315-228-7333</span></p><p>Crisis Text Line: Text \"Home\" to 741741</p><p>Suicide Prevention Hotline: 1-800-273-8255</p><p class=\"MsoNormal\"><o:p></o:p></p>', '0000-00-00 00:00:00', 1, 1, 'campus_jpg4.jpg', 'stamp_jpg4.jpg'),
(0, 'Getting Started With BetterMynd', 2, '<p>BetterMynds network of private counselors are here to provide you with the help that you need. Under the appointments tab, you can see all of the available counselors, review their bios and specializations, and then schedule a teletherapy session with the counselor thats right for you.<o:p></o:p></p><p><span style=\"font-family: Arial, Helvetica, sans-serif;\">After scheduling a session, you will receive an email with a link that you can open up when its time for your session. You can have your video-therapy session from anywhere that you can connect your laptop or smartphone.</span></p><p><o:p></o:p></p><p><o:p>&nbsp;</o:p><span style=\"font-family: Arial, Helvetica, sans-serif;\">Questions? Email us at students@bettermynd.com.</span></p><p><o:p></o:p></p><p><o:p>&nbsp;</o:p><span style=\"font-weight: 700; font-family: Arial, Helvetica, sans-serif;\">IMPORTANT:&nbsp;</span><span style=\"font-family: Arial, Helvetica, sans-serif;\">If you are experiencing a crisis situation or are having serious thoughts about hurting yourself or others, you should use the \"Crisis Resources\" listed on the right to get immediate help.</span></p><p class=\"MsoNormal\"><o:p></o:p></p>', '0000-00-00 00:00:00', 1, 0, '', ''),
(1, NULL, 3, '<p><b><font face=\"Arial Black\">Counseling Center</font></b></p><p>Phone: 315-859-4340</p><p><a href=\"https://www.hamilton.edu/offices/counselingcenter\" target=\"_blank\">Counseling Center Website</a></p><p><font face=\"Arial Black\">Crisis Resources</font></p><p>24/7 Crisis Line: Call 315-859-4340 and Press \"2\"</p><p>Crisis Text Line: Text \"START\" to 741741</p><p>Suicide Prevention Hotline: 1-800-273-8255</p>', '0000-00-00 00:00:00', 1, 5, 'college_landscape_narrow_png.png', 'Hamilton_Logo_2_jpg.jpg');
